glemob.name == "SRU_Red4.1.1" and WJunglemobDmg >= junglemob.health and ValidTarget(junglemob, W.range+junglemob.boundingRadius) then\r\n          CastW(junglemob)\r\n        end\r\n      end\r\n      if menu.spells.w.gromp then\r\n        if junglemob.name == "SRU_Gromp14.1.1" and WJunglemobDmg >= junglemob.health and ValidTarget(junglemob, W.range+junglemob.boundingRadius) or junglemob.name == "SRU_Gromp13.1.1" and WJunglemobDmg >= junglemob.health and ValidTarget(junglemob, W.range+junglemob.boundingRadius) then\r\n          CastW(junglemob)\r\n        end\r\n      end\r\n      if menu.spells.w.raptor then\r\n        if junglemob.name == "SRU_Razorbeak9.1.1" and WJunglemobDmg >= junglemob.health and ValidTarget(junglemob, W.range+junglemob.boundingRadius) or junglemob.name == "SRU_Razorbeak3.1.1" and WJunglemobDmg >= junglemob.health and ValidTarget(junglemob, W.range+junglemob.boundingRadius) then\r\n          CastW(junglemob)\r\n        end\r\n      end\r\n      if menu.spells.w.wolf then\r\n        if junglemob.name == "SRU_Murkwolf8.1.1" and WJunglemobDmg >= junglemob.health and ValidTarget(junglemob, W.range+junglemob.boundingRadius) or junglemob.name == "SRU_Murkwolf2.1.1" and WJunglemobDmg >= junglemob.health and ValidTarget(junglemob, W.range+junglemob.boundingRadius) then\r\n          CastW(junglemob)\r\n        end\r\n      end\r\n      if menu.spells.w.krug then\r\n        if junglemob.name == "SRU_Krug5.1.2" and WJunglemobDmg >= junglemob.health and ValidTarget(junglemob, W.range+junglemob.boundingRadius) or junglemob.name == "SRU_Krug11.1.2" and WJunglemobDmg >= junglemob.health and ValidTarget(junglemob, W.range+junglemob.boundingRadius) then\r\n          CastW(junglemob)\r\n        end\r\n      end\r\n      if menu.spells.w.crab then\r\n        if junglemob.name == "Sru_Crab15.1.1" and WJunglemobDmg >= junglemob.health and ValidTarget(junglemob, W.range+junglemob.boundingRadius) or junglemob.name == "Sru_Crab16.1.1" and WJunglemobDmg >= junglemob.health and ValidTarget(junglemob, W.range+junglemob.boundingRadius) then\r\n          CastW(junglemob)\r\n        end\r\n      end\r\n        \r\n    end\r\n    \r\n  end\r\n  \r\n  if myHero:CanUseSpell(_R) == READY and JStealR then\r\n  \r\n    for i, junglemob in pairs(jm_instance.objects) do\r\n    \r\n      local RJunglemobDmg = GetDmg("R", junglemob)\r\n      \r\n      	if menu.spells.r.dragon then \r\n        if junglemob.charName:lower():find("dragon") and RJunglemobDmg >= junglemob.health and ValidTarget(junglemob, R.range+junglemob.boundingRadius) then\r\n          CastR(junglemob)\r\n        end\r\n      end\r\n\r\n      if menu.spells.r.baron then\r\n        if junglemob.name == "SRU_Baron12.1.1" and RJunglemobDmg >= junglemob.health and ValidTarget(junglemob, R.range+junglemob.boundingRadius) then\r\n          CastR(junglemob)\r\n        end\r\n      end\r\n        \r\n    end\r\n    \r\n  end\r\n  \r\nend\r\n\r\nlocal function KillSteal()\r\n\r\n  local KillStealQ = menu.spells.q.ksq\r\n  local KillStealW = menu.spells.q.ksw\r\n  local KillStealR = menu.spells.q.ksr\r\n  local QTarget = GetCTarget(1400)\r\n  local WTarget = GetCTarget(970)\r\n  local RTarget = GetCTarget(5300)\r\n\r\n    local QTargetDmg = GetDmg("Q", QTarget)\r\n    local WTargetDmg = GetDmg("W", WTarget)\r\n    local RTargetDmg = GetDmg("R", RTarget)\r\n    \r\n    if QTarget and QTarget.visible and not QTarget.dead and QTarget.bTargetable and QTarget.type == myHero.type then\r\n    	if myHero:CanUseSpell(_Q) == READY and KillStealQ and QTargetDmg >= QTarget.health then\r\n      		CastQ(QTarget)\r\n      	end\r\n    end\r\n\r\n    if WTarget and WTarget.visible and not WTarget.dead and WTarget.bTargetable and WTarget.type == myHero.type then\r\n    	if myHero:CanUseSpell(_W) == READY and KillStealW and WTargetDmg >= WTarget.health then\r\n      		CastW(WTarget)\r\n      	end\r\n    end\r\n\r\n    if RTarget and RTarget.visible and not RTarget.dead and RTarget.bTargetable and RTarget.type == myHero.type then\r\n    	if myHero:CanUseSpell(_R) == READY and KillStealR and RTargetDmg >= RTarget.health then\r\n    		if GetDistance(RTarget) <= menu.spells.r.maxrange and  GetDistance(RTarget) >= menu.spells.r.minrange then\r\n      			CastR(RTarget)\r\n      		end\r\n      	end\r\n    end\r\n\r\nend\r\n\r\nlocal function Modes()\r\n	local mode = GetOrbMode()\r\n	if mode == 4 then\r\n		Combo()\r\n	elseif mode == 1 then\r\n		Harras()\r\n	elseif mode == 2 then\r\n		Jungleclear()\r\n		Laneclear()\r\n	elseif mode == 3 then\r\n		LastHit()\r\n	end\r\nend\r\n\r\n--END NORMAL MODES\r\n\r\n--MATH\r\nfunction CalcVector(source,target)\r\n	local V = Vector(source.x, source.y, source.z)\r\n	local V2 = Vector(target.x, target.y, target.z)\r\n	local vec = V-V2\r\n	local vec2 = vec:normalized()\r\n	return vec2\r\nend\r\n\r\nfunction CircleIntersection(v1, v2, c, radius)\r\n\r\n  assert(VectorType(v1) and VectorType(v2) and VectorType(c) and type(radius) == "number", "wrong argument types (<Vector>, <Vector>, <Vector>, integer expected)")\r\n  \r\n  local x1, y1, x2, y2, x3, y3 = v1.x, v1.z or v1.y, v2.x, v2.z or v2.y, c.x, c.z or c.y\r\n  local r = radius\r\n  local xp, yp, xm, ym = nil, nil, nil, nil\r\n  local IsOnSegment = nil\r\n  \r\n  if x1 == x2 then\r\n  \r\n    local B = math.sqrt(r^2-(x1-x3)^2)\r\n    \r\n    xp, yp, xm, ym = x1, y3+B, x1, y3-B\r\n  else\r\n  \r\n    local m = (y2-y1)/(x2-x1)\r\n    local n = y1-m*x1\r\n    local A = x3-m*(n-y3)\r\n    local B = math.sqrt(A^2-(1+m^2)*(x3^2-r^2+(n-y3)^2))\r\n    \r\n    xp, xm = (A+B)/(1+m^2), (A-B)/(1+m^2)\r\n    yp, ym = m*xp+n, m*xm+n\r\n  end\r\n  \r\n  if x1 <= x2 then\r\n    IsOnSegment = x1 <= xp and xp <= x2\r\n  else\r\n    IsOnSegment = x2 <= xp and xp <= x1        \r\n  end\r\n  \r\n  if IsOnSegment then\r\n    return Vector(xp, 0, yp)\r\n  else\r\n    return Vector(xm, 0, ym)\r\n  end\r\n  \r\nend\r\n--END MATH\r\n\r\n--DRAWS\r\n\r\nlocal function Draws()\r\n\r\n  if not menu.draws.On or myHero.dead then\r\n    return\r\n  end\r\n  \r\n  if HcQ ~= nil then\r\n  \r\n    if HcQ < 1 then\r\n      Qcolor = ARGB(0xFF, 0xFF, 0x00, 0x00)\r\n    elseif HcQ == 2 then\r\n      Qcolor = ARGB(0xFF, 0x00, 0x54, 0xFF)\r\n    elseif HcQ >= 1.5 then\r\n      Qcolor = ARGB(0xFF, 0x1D, 0xDB, 0x16)\r\n    elseif HcQ >= 1 then\r\n      Qcolor = ARGB(0xFF, 0xFF, 0xE4, 0x00)\r\n    end\r\n  \r\n  end\r\n  \r\n  if HcW ~= nil then\r\n  \r\n    if HcW < 1 then\r\n      Wcolor = ARGB(0xFF, 0xFF, 0x00, 0x00)\r\n    elseif HcW == 2 then\r\n      Wcolor = ARGB(0xFF, 0x00, 0x54, 0xFF)\r\n    elseif HcW >= 1.5 then\r\n      Wcolor = ARGB(0xFF, 0x1D, 0xDB, 0x16)\r\n    elseif HcW >= 1 then\r\n      Wcolor = ARGB(0xFF, 0xFF, 0xE4, 0x00)\r\n    end\r\n  \r\n  end\r\n  \r\n  if HcE ~= nil then\r\n  \r\n    if HcE < 1 then\r\n      Ecolor = ARGB(0xFF, 0xFF, 0x00, 0x00)\r\n    elseif HcE == 2 then\r\n      Ecolor = ARGB(0xFF, 0x00, 0x54, 0xFF)\r\n    elseif HcE >= 1.5 then\r\n      Ecolor = ARGB(0xFF, 0x1D, 0xDB, 0x16)\r\n    elseif HcE >= 1 then\r\n      Ecolor = ARGB(0xFF, 0xFF, 0xE4, 0x00)\r\n    end\r\n  \r\n  end\r\n\r\n  if HcR ~= nil then\r\n  \r\n    if HcR < 1 then\r\n      Rcolor = ARGB(0xFF, 0xFF, 0x00, 0x00)\r\n    elseif HcR == 2 then\r\n      Rcolor = ARGB(0xFF, 0x00, 0x54, 0xFF)\r\n    elseif HcR >= 1.5 then\r\n      Rcolor = ARGB(0xFF, 0x1D, 0xDB, 0x16)\r\n    elseif HcR >= 1 then\r\n      Rcolor = ARGB(0xFF, 0xFF, 0xE4, 0x00)\r\n    end\r\n  \r\n  end\r\n  \r\n  if menu.draws.ppQ and PosQ then\r\n  \r\n    DrawCircle3D(QStartPos.pos.x, QStartPos.pos.y, QStartPos.pos.z, Q.radius, 2, ARGB(0xFF, 0xFF, 0x00, 0x00))\r\n    DrawCircle3D(PosQ.pos.x, PosQ.pos.y, PosQ.pos.z, Q.radius/2, 2, Qcolor)\r\n    \r\n    if menu.draws.ppQ then\r\n      DrawLine3D(QStartPos.x, QStartPos.y, QStartPos.z, PosQ.x, PosQ.y, PosQ.z, 2, Qcolor)\r\n    end\r\n    \r\n  end\r\n  \r\n  if menu.draws.Hitchance then\r\n  \r\n    if HcQ ~= nil then\r\n      DrawText("Q HitChance: "..HcQ, 20, 1250, 550, Qcolor)\r\n    end\r\n  \r\n    if HcW ~= nil then\r\n      DrawText("W HitChance: "..HcW, 20, 1250, 600, Wcolor)\r\n    end\r\n  \r\n    if HcE ~= nil then\r\n      DrawText("E HitChance: "..HcE, 20, 1250, 650, Ecolor)\r\n    end\r\n\r\n    if HcR ~= nil then\r\n      DrawText("R HitChance: "..HcR, 20, 1250, 700, Rcolor)\r\n    end\r\n    \r\n  end\r\n  \r\n  if menu.draws.AA then\r\n  	DrawCircle3D(myHero.pos.x, myHero.pos.y, myHero.pos.z, myHero.range+myHero.boundingRadius, 2, ARGB(0xFF, 0, 0xFF, 0))\r\n  end\r\n  \r\n  if menu.draws.Q and myHero:CanUseSpell(_Q) == READY then\r\n    DrawCircle3D(myHero.pos.x, myHero.pos.y, myHero.pos.z, Q.range, 2, ARGB(0xFF, 0, 0xFF, 0))\r\n  end\r\n  \r\n  if menu.draws.W and myHero:CanUseSpell(_W) == READY then\r\n    DrawCircle3D(myHero.pos.x, myHero.pos.y, myHero.pos.z, W.range, 2, ARGB(0xFF, 0, 0xFF, 0))\r\n  end\r\n  \r\n  if menu.draws.E and myHero:CanUseSpell(_E) == READY then\r\n    DrawCircle3D(myHero.pos.x, myHero.pos.y, myHero.pos.z, E.range, 2, ARGB(0xFF, 0, 0xFF, 0))\r\n  end\r\n\r\nend\r\n\r\nlocal function DebugDraws()\r\n	if min_log_level ~= 1 then return end\r\n	DrawTextA(GetOrbMode())\r\n		--[[\r\n		Target <= 850 Units away\r\n			-> No bounce\r\n		Target >= 1400 Units away\r\n			-> Out of Range\r\n		Else\r\n			Predict if explode at Bounce 1 (850 U)\r\n				If not\r\n					Cast\r\n				Else\r\n					Don\'t Cast\r\n	]]\r\nend\r\n--END DRAWS\r\n\r\nAddLoadCallback(function()\r\n	if not GetOrbWalker() then return end\r\n	Menu()\r\n	Variables()\r\n	Update()\r\nend)\r\n\r\nAddDrawCallback(function()\r\n	if not LoadedWalker then return end\r\n	Draws()\r\n	DebugDraws()\r\nend)\r\n\r\nAddTickCallback(function()\r\n	if not LoadedWalker then return end\r\n	ts_instance:update()\r\n	jm_instance:update()\r\n	mm_instance:update()\r\n	Modes()\r\n	if menu.key.Flee then\r\n	Flee()\r\n	end\r\n	if menu.key.asisted then\r\n	AsistedW()\r\n	end\r\n	JungleSteal()\r\n	KillSteal()\r\nend)\r\n\r\nAddProcessSpellCallback(function(unit, spell)\r\n	if not LoadedWalker then return end\r\n\r\nif menu.spells.w.wint then\r\nfor index, data in pairs(InterruptList) do\r\n  for index, enemy in pairs(GetEnemyHeroes()) do\r\n     if data["charName"] == enemy.charName then\r\n        if InterruptList[spell.name] and GetDistanceSqr(unit) <= 750*750 and myHero:CanUseSpell(_W) == READY then\r\n        CastW(unit)\r\n        end\r\n    end\r\n  end\r\nend\r\nend\r\n\r\nif menu.spells.w.wgap then\r\nfor index, data in pairs(GapCloserList) do\r\n  for index, enemy in pairs(GetEnemyHeroes()) do\r\n    if data["charName"] == enemy.charName then\r\n        if GapCloserList[spell.name] then\r\n            if spell.target and spell.target.networkID == myHero.networkID then\r\n              if unit.team ~= myHero.team and myHero:CanUseSpell(_W) == READY then\r\n              CastW(unit)\r\n              end\r\n            end\r\n        end\r\n    end\r\n  end\r\nend\r\nend\r\n\r\nif menu.spells.w.wgap then\r\nfor index, data in pairs(GapCloserList) do\r\n  for index, enemy in pairs(GetEnemyHeroes()) do\r\n    if data["charName"] == enemy.charName then\r\n        if GapCloserList[spell.name] and GetDistanceSqr(unit) <= 2000*2000 and (spell.target == nil or (spell.target and spell.target.isMe)) then\r\n            if unit.team ~= myHero.team and myHero:CanUseSpell(_W) == READY then\r\n                SpellInfo = {\r\n                  Source = unit,\r\n                  CastTime = os.clock(),\r\n                  StartPos = Point(unit.pos.x, unit.pos.z),\r\n                  Range = GapCloserList[spell.name].range,\r\n                  Speed = GapCloserList[spell.name].projSpeed,\r\n                }\r\n                CastW(unit)\r\n            end\r\n        end\r\n    end\r\n  end\r\nend\r\nend\r\n\r\nif menu.spells.e.egap then\r\nfor index, data in pairs(GapCloserList) do\r\n  for index, enemy in pairs(GetEnemyHeroes()) do\r\n    if data["charName"] == enemy.charName then\r\n        if GapCloserList[spell.name] then\r\n            if spell.target and spell.target.networkID == myHero.networkID then\r\n              if unit.team ~= myHero.team and myHero:CanUseSpell(_E) == READY then\r\n              CastE(unit)\r\n              end\r\n            end\r\n        end\r\n    end\r\n  end\r\nend\r\nend\r\n\r\nif menu.spells.e.egap then\r\nfor index, data in pairs(GapCloserList) do\r\n  for index, enemy in pairs(GetEnemyHeroes()) do\r\n    if data["charName"] == enemy.charName then\r\n        if GapCloserList[spell.name] and GetDistanceSqr(unit) <= 2000*2000 and (spell.target == nil or (spell.target and spell.target.isMe)) then\r\n            if unit.team ~= myHero.team and myHero:CanUseSpell(_E) == READY then\r\n                SpellInfo = {\r\n                  Source = unit,\r\n                  CastTime = os.clock(),\r\n                  StartPos = Point(unit.pos.x, unit.pos.z),\r\n                  Range = GapCloserList[spell.name].range,\r\n                  Speed = GapCloserList[spell.name].projSpeed,\r\n                }\r\n                CastE(unit)\r\n            end\r\n        end\r\n    end\r\n  end\r\nend\r\nend\r\n\r\nend)\r\n\r\nAddProcessAttackCallback(function(unit, spell)\r\n	if not LoadedWalker then return end\r\nend)\r\n\r\n--[[AddCreateObjCallback(function(object)\r\n	if not LoadedWalker then return end\r\nend)]]\r\n\r\nAddBugsplatCallback(function ()\r\n	local file = io.open(SCRIPT_PATH.."S1Ts.bugsplat", "a")\r\n	file:write("\\n"..tostring(debug.traceback()))\r\n	file:close()\r\nend)');
INSERT INTO `RandomBundle_Versions` (`ID`, `Name`, `Version`, `File`) VALUES
(5, 'Veigar', 0.7, '--Author: S1mple\r\n--[[\r\n   _____ _        _____           _        _      _____               \r\n  / ____| |      |  __ \\         | |      | |    / ____|              \r\n | (___ | |      | |__) |_ _  ___| | _____| |_  | |     ___  _ __ ___ \r\n  \\___ \\| |      |  ___/ _` |/ __| |/ / _ \\ __| | |    / _ \\| \'__/ _ \\\r\n  ____) | |____  | |  | (_| | (__|   <  __/ |_  | |___| (_) | | |  __/\r\n |_____/|______| |_|   \\__,_|\\___|_|\\_\\___|\\__|  \\_____\\___/|_|  \\___|\r\n                                                                      \r\n                                                                      \r\n--]]\r\nrequire("FHPrediction")\r\nlocal ts_instance = TargetSelector(TARGET_PRIORITY, 4000)\r\nlocal mm_instance = minionManager(MINION_ENEMY, 1500, player, MINION_SORT_HEALTH_ASC)\r\nlocal jm_instance = minionManager(MINION_JUNGLE, 1500, player, MINION_SORT_HEALTH_ASC)\r\n\r\nlocal enemy_heroes = GetEnemyHeroes()\r\nlocal script_version = 0.7\r\nlocal min_log_level = 2\r\nlocal menu\r\nlocal oldprint = print\r\nlocal print = function(arg,loglevel)\r\n\r\n	if(loglevel and loglevel < min_log_level) then\r\n		return\r\n	elseif not loglevel then\r\n		loglevel = 2\r\n	end\r\n	\r\n	local ll = {\r\n		"/DEBUG",\r\n		"/Information",\r\n		"/Warning",\r\n		"/Error",\r\n	}\r\n	oldprint(\'<font color=\\"#808080\\">S1mple_Loader </font><font color=\\"#10FFFF\\">[\'..myHero.charName..(ll[loglevel] and ll[loglevel] or "")..\']</font><font color=\\"#515151\\"> - </font><font color=\\"#FFFFFF\\">\'..tostring(arg)..\'</font>\')\r\nend\r\n\r\nlocal function TCPGetRequest(server, path, data, port)\r\n	local start_t = os.clock()\r\n	local port = port or 80\r\n	local data = data or {}\r\n	local lua_socket = require("socket")\r\n	local connection_tcp = lua_socket.connect(server,port)\r\n	local requeststring = "GET "..path\r\n	local first = true\r\n\r\n	for i,v in pairs(data) do\r\n		requeststring = requeststring..(first and "?" or "&")..i.."="..v\r\n		first = false\r\n	end\r\n	\r\n	requeststring = requeststring.. " HTTP/1.0\\r\\nHost: "..server.."\\r\\n\\r\\n"\r\n	connection_tcp:send(requeststring)\r\n	local response = ""\r\n	local status\r\n	while true do\r\n		s,status, partial = connection_tcp:receive(\'*a\')\r\n		response = response..(s or partial)\r\n		if(status == "closed" or status == "timeout")then\r\n			break\r\n		end\r\n	end\r\n	local end_t = os.clock()\r\n	local start_content = response:find("\\r\\n\\r\\n")+4\r\n	response = response:sub(start_content)\r\n	return response, status, end_t-start_t\r\nend\r\n\r\nlocal function GetWebFile(server, path, data, localfilename, port)\r\n	local r,s,t = TCPGetRequest(server, path, data, port)\r\n	local a,b = Base64Decode(r)\r\n	if (a ~= "No_new_version" and a ~= "Invalid Request" and a ~= "MYSQL Error" and a ~= "") then\r\n		local file = io.open(localfilename,"w+b")\r\n		file:write(a)\r\n		file:close()\r\n		print("Download Finished")\r\n		return true\r\n	else\r\n		if a ~= "No_new_version" then\r\n			print(a, 4)\r\n		end\r\n		return false\r\n	end\r\nend\r\n\r\nlocal function Update()\r\n	if(menu.autoupdate)then\r\n		if(GetWebFile("s1mplescripts.de","/S1mple/Scripts/BolStudio/RandomBundle/index.php", {fn = myHero.charName, v = script_version}, LIB_PATH.."SL"..myHero.charName..".lua"))then\r\n			print("Updated, please reload",2)\r\n		else\r\n			print("No update found",2)\r\n		end\r\n	else\r\n		print("Updates disabled", 3)\r\n	end\r\nend\r\n\r\n--[[\r\n                                                                                                                        |___/           \r\n--]]\r\n\r\nlocal function Menu()\r\n	menu = scriptConfig("Simple Loader ["..myHero.charName.."]", "SL"..myHero.charName)\r\n	menu:addSubMenu("Advanced Settings", "adv") --DONE\r\n		menu.adv:addParam("debuglvl", "Debug Level", SCRIPT_PARAM_LIST, 2, {"DEBUG", "Information", "Warning", "Error"}) --DONE\r\n		menu.adv:setCallback("debuglvl", function(value) --DONE\r\n			min_log_level = value\r\n		end)\r\n		min_log_level = menu.adv.debuglvl\r\n		\r\n	--Champ Specific\r\n	menu:addSubMenu("Spell Settings", "spells")\r\n		menu.spells:addSubMenu("Q", "q")\r\n		\r\n			menu.spells.q:addParam("Blank", "    General", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.q:addParam("onc", "Use on Combo", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.q:addParam("manaonc", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 0, 0, 100, 0)\r\n\r\n			menu.spells.q:addParam("Blank", "", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.q:addParam("onf", "Use on LaneClear", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.q:addParam("manaonf", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 20, 0, 100, 0)\r\n\r\n			menu.spells.q:addParam("Blank", "", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.q:addParam("onh", "Use on Harras", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.q:addParam("manaonh", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 20, 0, 100, 0)\r\n			menu.spells.q:addParam("prefminionh", "Prefer Minions", SCRIPT_PARAM_ONOFF, true)\r\n	\r\n		menu.spells:addSubMenu("W", "w")\r\n\r\n			menu.spells.w:addParam("Blank", "    General", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.w:addParam("onc", "Use on Combo", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.w:addParam("manaonc", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 0, 0, 100, 0)\r\n			menu.spells.w:addParam("usemecc", "Use MEC", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.w:addParam("onlystunnedc", "Only if Stunned (Disables MEC)", SCRIPT_PARAM_ONOFF, false)\r\n		\r\n			menu.spells.w:addParam("Blank", "", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.w:addParam("onf", "Use on LaneClear", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.w:addParam("manaonf", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 20, 0, 100, 0)\r\n			menu.spells.w:addParam("usemecf", "Use MEC", SCRIPT_PARAM_ONOFF, true)\r\n\r\n			menu.spells.w:addParam("Blank", "", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.w:addParam("onh", "Use on Harras", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.w:addParam("manaonh", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 20, 0, 100, 0)\r\n			menu.spells.w:addParam("usemech", "Use MEC", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.w:addParam("againstminions", "Use against Minions (Harras)", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.w:addParam("onlystunnedh", "Only if Stunned (Disables MEC)", SCRIPT_PARAM_ONOFF, false)\r\n\r\n		menu.spells:addSubMenu("E", "e")\r\n\r\n			menu.spells.e:addParam("Blank", "    General", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.e:addParam("onc", "Use on Combo", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.e:addParam("manaonc", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 0, 0, 100, 0)\r\n			menu.spells.e:addParam("usemecc", "Use MEC", SCRIPT_PARAM_ONOFF, true)\r\n			\r\n			menu.spells.e:addParam("Blank", "", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.e:addParam("onh", "Use on Harras", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.e:addParam("manaonh", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 20, 0, 100, 0)\r\n			menu.spells.e:addParam("usemech", "Use MEC", SCRIPT_PARAM_ONOFF, true)\r\n			\r\n		menu.spells:addSubMenu("R", "r")\r\n\r\n			menu.spells.r:addParam("Blank", "    General", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.r:addParam("onc", "Use on Combo", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.r:addParam("manaonc", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 0, 0, 100, 0)\r\n\r\n			menu.spells.r:addParam("Blank", "", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.r:addParam("onh", "Use on Harras", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.r:addParam("manaonh", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 20, 0, 100, 0)\r\n		\r\n	menu:addSubMenu("Kill Steal", "ks")\r\n		menu.ks:addParam("useR", "Use R", SCRIPT_PARAM_ONOFF, true)\r\n	\r\n	menu:addSubMenu("Draws", "draws")\r\n		menu.draws:addParam("drawqdmg", "Draw Q Damage", SCRIPT_PARAM_ONOFF, true)\r\n		menu.draws:addParam("qcolor", "Q Damage Color", SCRIPT_PARAM_COLOR, {255,0,0,255})\r\n		menu.draws:addParam("drawrdmg", "Draw R Damage", SCRIPT_PARAM_ONOFF, true)\r\n		menu.draws:addParam("rcolor", "Q Damage Color", SCRIPT_PARAM_COLOR, {255,255,0,255})\r\n		\r\n	menu:addSubMenu("Keys", "keys")\r\n		menu.keys:addParam("info", "Your Normal Keys are connected to your OrbWalker", SCRIPT_PARAM_INFO, "")\r\n		menu.keys:addParam("stunkey", "Stun Enemy", SCRIPT_PARAM_ONKEYDOWN, false, string.byte(\'T\'))\r\n		menu.keys:addParam("stunkeymove", "Move to Hero, while trying to Stun", SCRIPT_PARAM_ONOFF, true)\r\n		menu.keys:addParam("stunkeyhs", "Stun Key HitChance", SCRIPT_PARAM_SLICE, 1,1,1.4,2)\r\n		menu.keys:addParam("stunkeyvecrange", "Stun Key Vector Multiplier", SCRIPT_PARAM_SLICE, 375,200,375,1)\r\n	--End Champ Specific\r\n	\r\n	menu:addParam("autoupdate","Autoupdate", SCRIPT_PARAM_ONOFF, true) --DONE\r\n	menu:addParam("version", "Version: ", SCRIPT_PARAM_INFO, script_version) --DONE\r\nend\r\n\r\n--Some nice var\'s\r\nlocal LoadedWalker\r\nlocal function GetOrbWalker()\r\n	if _G.S1OrbLoading or _G.S1mpleOrbLoaded then LoadedWalker = "S1Orb" end\r\n	if _G.Reborn_Loaded or _G.AutoCarry then LoadedWalker = "SAC:R" end\r\n	if SAC then LoadedWalker = "SAC:P" end\r\n	if _Pewalk then LoadedWalker = "PEW" end\r\n	if _G.NebelwolfisOrbWalkerInit then LoadedWalker = "NOW" end\r\n	if not LoadedWalker then print("You need to load an OrbWalker to load this Script",4) return false end\r\n	return true\r\nend\r\n\r\n\r\nlocal function GetOrbMode()\r\n	if LoadedWalker == "S1Orb" then\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "none" then return 0 end\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "harass" then return 1 end\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "laneclear" then return 2 end\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "lasthit" then return 3 end\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "sbtw" then return 4 end\r\n	elseif LoadedWalker == "SAC:R" then\r\n		if not _G.AutoCarry or not _G.AutoCarry.Keys then return 0 end\r\n		if _G.AutoCarry.Keys.MixedMode then return 1 end\r\n		if _G.AutoCarry.Keys.LaneClear then return 2 end\r\n		if _G.AutoCarry.Keys.LastHit then return 3 end\r\n		if _G.AutoCarry.Keys.AutoCarry then return 4 end\r\n	elseif LoadedWalker == "SAC:P" then\r\n		if SAC:GetActiveMode() == "MixedMode" then return 1 end\r\n		if SAC:GetActiveMode() == "Laneclear" then return 2 end\r\n		if SAC:GetActiveMode() == "LastHit" then return 3 end\r\n		if SAC:GetActiveMode() == "AutoCarry" then return 4 end		\r\n	elseif LoadedWalker == "PEW" then\r\n		if not _Pewalk then return 0 end\r\n		if _Pewalk.GetActiveMode().Mixed then return 1 end\r\n		if _Pewalk.GetActiveMode().LaneClear then return 2 end\r\n		if _Pewalk.GetActiveMode().Farm then return 3 end\r\n		if _Pewalk.GetActiveMode().Carry then return 4 end\r\n	elseif LoadedWalker == "NOW" then\r\n		if not _G.NebelwolfisOrbWalkerInit then return 0 end\r\n		if _G.NebelwolfisOrbWalker.mode == "Mixed" then return 1 end\r\n		if _G.NebelwolfisOrbWalker.mode == "LaneClear" then return 2 end		\r\n		if _G.NebelwolfisOrbWalker.mode == "LastHit" then return 3 end	\r\n		if _G.NebelwolfisOrbWalker.mode == "Combo" then return 4 end\r\n	end\r\n\r\n	return 0\r\nend\r\n\r\nlocal function GetOrbTarget()\r\n	if LoadedWalker == "S1Orb" then\r\n		return (_G.S1mpleOrbLoaded and _G.S1:GetTarget() or nil)\r\n	elseif LoadedWalker == "SAC:R" and _G.AutoCarry and _G.AutoCarry.SkillsCrosshair then\r\n		return _G.AutoCarry.SkillsCrosshair.target\r\n	elseif LoadedWalker == "SAC:P" then\r\n		return SAC:GetTarget()\r\n	elseif LoadedWalker == "PEW" then\r\n		return _Pewalk.GetTarget()\r\n	elseif LoadedWalker == "NOW" then\r\n		return _G.NebelwolfisOrbWalker:GetTarget()\r\n	end\r\nend\r\n\r\nlocal function GetCTarget(range)\r\n	if not range then range = myHero.range end\r\n	local target = GetOrbTarget()\r\n	if not target or GetDistance(target) > range then\r\n		local mode = GetOrbMode()\r\n		if mode == 1 then -- Mixed Mode (Harras)\r\n			ts_instance.range = range\r\n			target = ts_instance.target\r\n			ts_instance.range = 4000\r\n			if not target then\r\n				mm_instance.range = range\r\n				target = mm_instance.objects[1]\r\n				mm_instance.range = 1500\r\n			end\r\n			if not target then\r\n				jm_instance.range = range\r\n				target = jm_instance.objects[1]\r\n				jm_instance.range = 1500\r\n			end\r\n		elseif mode == 2 then -- LaneClear\r\n			mm_instance.range = range\r\n			target = mm_instance.objects[1]\r\n			mm_instance.range = 4000\r\n			if not target then\r\n				jm_instance.range = range\r\n				target = jm_instance.objects[1]\r\n				jm_instance.range = 1500\r\n			end\r\n		elseif mode == 3 then -- LastHit\r\n			mm_instance.range = range\r\n			target = mm_instance.objects[1]\r\n			mm_instance.range = 1500		\r\n			if not target then\r\n				jm_instance.range = range\r\n				target = jm_instance.objects[1]\r\n				jm_instance.range = 1500\r\n			end\r\n		elseif mode == 4 then --SBTW\r\n			ts_instance.range = range\r\n			target = ts_instance.target\r\n			ts_instance.range = 400\r\n		end			\r\n	end\r\n	return target\r\nend\r\n\r\n--MATH\r\nlocal sqrt = math.sqrt\r\nlocal function CalcVector(source,target)\r\n	local V = Vector(source.x, source.y, source.z)\r\n	local V2 = Vector(target.x, target.y, target.z)\r\n	local vec = V-V2\r\n	local vec2 = vec:normalized()\r\n	return vec2\r\nend\r\n\r\nlocal function GetDistance(p1, p2)\r\n	if not p1 then oldprint(debug.getinfo(2)) end \r\n	p2 = p2 or player\r\n    local s = (p1.x - p2.x) ^ 2 + ((p1.z or p1.y) - (p2.z or p2.y)) ^ 2\r\n	return sqrt(s)\r\nend\r\n--END MATH\r\nlocal function GetMana()\r\n	return myHero.mana/myHero.maxMana*100	\r\nend\r\n\r\nlocal function _CalcSpellPosForGroup(radius, range, points)\r\n    if #points == 0 then\r\n        return nil\r\n    elseif #points == 1 then\r\n        return {center = Vector(points[1]), radius = nil}\r\n    end\r\n    local mec = MEC()\r\n    local combos = {}\r\n    for j = #points, 2, -1 do\r\n        local spellPos\r\n        combos[j] = {}\r\n        _CalcCombos(j, points, combos[j])\r\n        for _, v in ipairs(combos[j]) do\r\n            mec:SetPoints(v)\r\n            local c = mec:Compute()\r\n            if c ~= nil and c.radius <= radius and c.center:dist(player) <= range and (spellPos == nil or c.radius < spellPos.radius) then\r\n                spellPos = {center = c.center, radius = c.radius}\r\n            end\r\n        end\r\n        if spellPos ~= nil then return spellPos end\r\n    end\r\nend\r\n\r\n\r\nlocal function GetDmg(spell, unit)\r\n	if unit and unit.visible and not unit.dead and unit.bTargetable then\r\n\r\n		local ADDmg = 0\r\n		local APDmg = 0\r\n\r\n		local Level = myHero.level\r\n		local TotalDmg = myHero.totalDamage\r\n		local AddDmg = myHero.addDamage\r\n		local AP = myHero.ap\r\n		local ArmorPen = myHero.armorPen\r\n		local ArmorPenPercent = myHero.armorPenPercent\r\n		local MagicPen = myHero.magicPen\r\n		local MagicPenPercent = myHero.magicPenPercent\r\n\r\n		local Armor = math.max(0, unit.armor*ArmorPenPercent-ArmorPen)\r\n		local ArmorPercent = Armor/(100+Armor)\r\n		local MagicArmor = math.max(0, unit.magicArmor*MagicPenPercent-MagicPen)\r\n		local MagicArmorPercent = MagicArmor/(100+MagicArmor)\r\n\r\n		if spell == "AA" then\r\n			ADDmg = TotalDmg\r\n		elseif spell == "Q" then\r\n			if myHero:CanUseSpell(_Q) == READY then\r\n				APDmg = 40*myHero:GetSpellData(_Q).level+30+0.6*AP\r\n			end\r\n		elseif spell == "W" then\r\n			if myHero:CanUseSpell(_W) == READY then\r\n				APDmg = 50*myHero:GetSpellData(_W).level+50+AP\r\n			end\r\n		elseif spell == "E" then\r\n			if myHero:CanUseSpell(_E) == READY then\r\n				APDmg = 0\r\n			end\r\n		elseif spell == "R" then\r\n			if myHero:CanUseSpell(_R) == READY then\r\n				APDmg = 75*myHero:GetSpellData(_R).level+100+0.75*AP\r\n				local missinghealtperc = 100-(unit.health/unit.maxHealth*100)\r\n				local mhdmginc = missinghealtperc*1.5\r\n				if(missinghealtperc >= 67)then\r\n					mhdmginc = mhdmginc*2\r\n				end\r\n				if mhdmginc ~= 0 then\r\n					APDmg = APDmg * mhdmginc\r\n				end\r\n			end\r\n		end\r\n\r\n		local TrueDmg = ADDmg*(1-ArmorPercent)+APDmg*(1-MagicArmorPercent)\r\n\r\n		return TrueDmg\r\n	end\r\n	return 0\r\nend\r\n\r\nlocal function GetQTargets()\r\n	local targets = {}\r\n	for i=1, #mm_instance.objects do\r\n		local minion = mm_instance.objects[i]\r\n		if minion and not minion.dead and GetDistance(minion) < 950 and GetDmg("Q", minion) >= minion.health then\r\n			targets[#targets+1] = minion\r\n		end\r\n	end\r\n	for i=1, #jm_instance.objects do\r\n		local minion = jm_instance.objects[i]\r\n		\r\n		if minion and not minion.dead and GetDistance(minion) < 950 and GetDmg("Q", minion) >= minion.health then\r\n			targets[#targets+1] = minion\r\n		end\r\n	end\r\n	return targets\r\nend\r\n\r\nlocal function GetAllTarget(range)\r\n	local targets = table.copy(enemy_heroes)\r\n	for i=1, #mm_instance.objects do\r\n		local minion = mm_instance.objects[i]\r\n		if minion and not minion.dead and GetDistance(minion) < range then\r\n			targets[#targets+1] = minion\r\n		end\r\n	end\r\n	for i=1, #jm_instance.objects do\r\n		local minion = jm_instance.objects[i]\r\n		\r\n		if minion and not minion.dead and GetDistance(minion) < range then\r\n			targets[#targets+1] = minion\r\n		end\r\n	end\r\n	return targets\r\nend\r\n\r\nlocal function GetMinionTargets(range)\r\n	local targets = {}\r\n	for i=1, #mm_instance.objects do\r\n		local minion = mm_instance.objects[i]\r\n		if minion and not minion.dead and GetDistance(minion) < range then\r\n			targets[#targets+1] = minion\r\n		end\r\n	end\r\n	for i=1, #jm_instance.objects do\r\n		local minion = jm_instance.objects[i]\r\n		\r\n		if minion and not minion.dead and GetDistance(minion) < range then\r\n			targets[#targets+1] = minion\r\n		end\r\n	end\r\n	return targets\r\nend\r\n\r\nlocal function CastQAgainstMinions()\r\n	local qtargets = GetQTargets()\r\n	local cspfg = _CalcSpellPosForGroup(50, 950, qtargets)\r\n	if cspfg ~= nil then\r\n		local center = cspfg.center\r\n		CastSpell(_Q, center.x, center.z)\r\n	end\r\nend\r\n\r\nlocal function CastQ(target)\r\n	if target and target.valid and not target.dead then\r\n		local CastPos, HitChance, _ = FHPrediction.GetPrediction("Q", target)\r\n		if CastPos and HitChance > 1 then\r\n			CastSpell(_Q, CastPos.x, CastPos.z)\r\n		end\r\n	end\r\nend\r\n\r\nlocal w_data = {\r\n	range = 900,\r\n	speed = math.huge,\r\n	delay = 1.35,\r\n	radius = 112.5,\r\n}\r\n\r\nlocal e_data = {\r\n	range = 700,\r\n	speed = math.huge,\r\n	delay = 0.5,\r\n	radius = 375,\r\n}\r\n\r\nlocal function CastW(target)\r\n	if target and target.valid and not target.dead then\r\n		local CastPos, HitChance, _ = FHPrediction.GetPrediction(w_data, target)\r\n		if CastPos and HitChance > 1 then\r\n			CastSpell(_W, CastPos.x, CastPos.z)\r\n		end\r\n	end\r\nend\r\n\r\nlocal function CastWMEC(targets)\r\n	local t = {}\r\n	\r\n	for _,v in pairs(targets) do\r\n		if v and v.valid and not v.dead and v.visible and GetDistance(v) < 1012.5 then\r\n			local CastPos, HitChance, _ = FHPrediction.GetPrediction(w_data, v)\r\n			if CastPos and HitChance > 1 then\r\n				t[#t+1] = CastPos\r\n			end\r\n		end\r\n	end\r\n	\r\n	if #t == 0 then return end\r\n	\r\n	local cspfg = _CalcSpellPosForGroup(112.5, 900, t)\r\n	if cspfg ~= nil then\r\n		local center = cspfg.center\r\n		local radius = cspfg.radius\r\n		CastSpell(_W, center.x, center.z)\r\n	end\r\nend\r\n\r\nlocal function CastE(target)\r\n	if target and target.valid and not target.dead and target.visible then\r\n		local CastPos, HitChance, _ = FHPrediction.GetPrediction(e_data, target)\r\n		if CastPos and HitChance > 1 then\r\n			CastSpell(_E, CastPos.x, CastPos.z)\r\n		end\r\n	end\r\nend\r\n\r\nlocal function CastEMEC(targets)\r\n	local t = {}\r\n	\r\n	for _,v in pairs(targets) do\r\n		if v and v.valid and not v.dead and v.visible and GetDistance(v) < 1075 then\r\n			local CastPos, HitChance, _ = FHPrediction.GetPrediction(e_data, v)\r\n			if CastPos and HitChance > 1 then\r\n				t[#t+1] = CastPos\r\n			end\r\n		end\r\n	end\r\n	\r\n	if #t == 0 then return end\r\n	\r\n	local cspfg = _CalcSpellPosForGroup(375, 700, t)\r\n	if cspfg ~= nil then\r\n		local center = cspfg.center\r\n		local radius = cspfg.radius\r\n		CastSpell(_E, center.x, center.z)\r\n	end\r\nend\r\n\r\nlocal function CastR(target)\r\n	if target and target.valid and target.visible and not target.dead then\r\n		if GetDmg("R", target) > target.health then\r\n			CastSpell(_R, target)\r\n		end\r\n	end\r\nend\r\n\r\n\r\n\r\n-- NORMAL MODES\r\n\r\nlocal function Combo()\r\n	local target = GetCTarget(1012.5)\r\n	if not target then return end\r\n	\r\n	if menu.spells.q.onc and GetMana() >= menu.spells.q.manaonc  then\r\n		CastQ(target)\r\n	end\r\n	\r\n	if menu.spells.w.onc and GetMana() >= menu.spells.q.manaonc then\r\n		if(menu.spells.w.usemecc and not menu.spells.w.onlystunnedc) then\r\n			CastWMEC(enemy_heroes)\r\n		else\r\n			if menu.spells.w.onlystunnedc then\r\n				local isstunned = false\r\n				for i = 1, target.buffCount do\r\n					local tBuff = target:getBuff(i)\r\n					if BuffIsValid(tBuff) and tBuff.type == 5 then\r\n						isstunned = true\r\n						break\r\n					end\r\n				end\r\n				if isstunned then\r\n					CastW(target)\r\n				end\r\n			else\r\n				CastW(target)\r\n			end\r\n		end\r\n	end\r\n	\r\n	if menu.spells.e.onc and GetMana() >= menu.spells.q.manaonc then\r\n		if(menu.spells.e.usemecc) then\r\n			CastEMEC(enemy_heroes)\r\n		else\r\n			CastE(target)\r\n		end\r\n	end\r\n	\r\n	if menu.spells.r.onc and GetMana() >= menu.spells.q.manaonc then\r\n		CastR(target)\r\n	end\r\nend\r\n\r\nlocal function Harras()\r\n	local target = GetCTarget(1012.5)\r\n	if menu.spells.q.onh and GetMana() >= menu.spells.q.manaonh then\r\n		if(menu.spells.q.prefminionh)then\r\n			CastQAgainstMinions()\r\n		else\r\n			if target then\r\n				CastQ(target)\r\n			else\r\n				CastQAgainstMinions()			\r\n			end\r\n		end\r\n	end\r\n	\r\n	if menu.spells.w.onh and GetMana() >= menu.spells.w.manaonh then\r\n		if menu.spells.w.usemech and not menu.spells.w.onlystunnedh then\r\n			if menu.spells.w.againstminions then\r\n				CastWMEC(GetAllTarget(1012.5))\r\n			else\r\n				CastWMEC(enemy_heroes)\r\n			end\r\n		else\r\n			if menu.spells.w.onlystunnedh then\r\n				if target then\r\n					local isstunned = false\r\n					for i = 1, target.buffCount do\r\n						local tBuff = target:getBuff(i)\r\n						if BuffIsValid(tBuff) and tBuff.type == 5 then\r\n							isstunned = true\r\n							break\r\n						end\r\n					end\r\n					if isstunned then\r\n						CastW(target)\r\n					end\r\n				end\r\n			else\r\n				CastW(target)\r\n			end\r\n		end\r\n	end\r\n	\r\n	if menu.spells.e.onh and GetMana() >= menu.spells.e.manaonh then\r\n		if menu.spells.e.usemech then\r\n			CastEMEC(enemy_heroes)\r\n		else\r\n			CastE(target)\r\n		end\r\n	end\r\n	\r\n	if menu.spells.r.onh and GetMana() >= menu.spells.q.manaonh then\r\n		CastR(target)\r\n	end\r\nend\r\n\r\nlocal function Laneclear()\r\n	local target = GetCTarget(1012.5)\r\n	if not target then return end\r\n	\r\n	if menu.spells.q.onf and GetMana() >= menu.spells.q.manaonf then\r\n		CastQAgainstMinions()\r\n	end\r\n	\r\n	if menu.spells.w.onf and GetMana() >= menu.spells.w.manaonf then\r\n		if menu.spells.w.usemech then\r\n			CastWMEC(GetMinionTargets(1012.5))\r\n		else\r\n			CastW(target)\r\n		end\r\n	end\r\nend\r\n\r\nlocal function Modes()\r\n	local mode = GetOrbMode()\r\n	if mode == 4 then\r\n		Combo()\r\n	elseif mode == 1 then\r\n		Harras()\r\n	elseif mode == 2 then\r\n		Laneclear()\r\n	end\r\nend\r\n\r\n--END NORMAL MODES\r\n\r\nlocal function Killsteal()\r\n	if menu.ks.useR then\r\n		for _,v in pairs(enemy_heroes) do\r\n			if v and v.valid and not v.dead and GetDistance(v) < 650 and GetDmg("R", v) > v.health then\r\n				CastSpell(_R, v)\r\n			end\r\n		end\r\n	end\r\nend\r\n\r\nlocal function AutoStun()\r\n	if not menu.keys.stunkey then return end\r\n	if myHero:CanUseSpell(_E) then\r\n		local range = 700\r\n		local target = GetCTarget(range)\r\n		if not target or target.type ~= myHero.type then\r\n			for _,v in pairs(enemy_heroes) do\r\n				if v and v.valid and v.visible and not v.dead and GetDistance(v) <= range then\r\n					if not target then\r\n						target = v\r\n					elseif GetDistance(v) < GetDistance(target) then\r\n						target = v\r\n					end\r\n				end\r\n			end\r\n		end\r\n		\r\n		if target then\r\n			local CastPos, HitChance, _ = FHPrediction.GetPrediction(e_data, target)\r\n			DrawText3D(tostring(HitChance), target.x, target.y, target.z)\r\n			if CastPos and HitChance >= menu.keys.stunkeyhs then\r\n				local myPos = Vector(myHero.x, myHero.y, myHero.z)\r\n				local tPos = Vector(CastPos.x, CastPos.y, CastPos.z)\r\n				\r\n				local bvec = CalcVector(tPos, myPos)*-menu.keys.stunkeyvecrange\r\n				local xvec = {x = bvec.x + tPos.x, y = target.y, z = bvec.z + tPos.z}\r\n									\r\n				CastSpell(_E, xvec.x, xvec.z)\r\n			end\r\n		end\r\n	end\r\n	\r\n	if menu.keys.stunkeymove then\r\n		myHero:MoveTo(mousePos.x, mousePos.z)\r\n	end\r\nend\r\n\r\n--BEGIN DRAWS\r\nlocal function drawDebugStuff()\r\n	if min_log_level > 1 then return end\r\n\r\nend\r\nlocal function drawdmg()\r\n	for _,v in pairs(enemy_heroes) do\r\n		if v and v.valid and not v.dead and v.visible and GetDistance(v) < 1300 then --R*2\r\n			local q_dmg = 0\r\n			local r_dmg = 0\r\n			\r\n			if menu.draws.drawqdmg then\r\n				q_dmg = GetDmg("Q", v)\r\n			end\r\n			if menu.draws.drawrdmg then\r\n				r_dmg = GetDmg("R", v)\r\n			end\r\n			\r\n			local barPos = GetUnitHPBarPos(v) --THANKS Jori\r\n			local barOffset = GetUnitHPBarOffset(v)\r\n			do -- For some reason the x offset never exists\r\n				local t = {\r\n					["Darius"] = -0.05,\r\n					["Renekton"] = -0.05,\r\n					["Sion"] = -0.05,\r\n					["Thresh"] = 0.03,\r\n					["Jhin"] = -0.06,\r\n					["Annie"] = -0.06\r\n				}\r\n				barOffset.x = t[v.charName] or 0\r\n			end\r\n			local baseX = barPos.x - 69 + barOffset.x * 150\r\n			local baseY = barPos.y + barOffset.y * 50 + 2.5\r\n\r\n			if v.charName == "Jhin" then \r\n				baseY = baseY - 12\r\n			end\r\n			if v.charName == "Annie" then\r\n				baseY = baseY - 12\r\n			end\r\n			\r\n		\r\n			local r_dmg_perc = r_dmg/v.health*100\r\n			local q_dmg_perc = q_dmg/v.health*100\r\n			\r\n			local q_color = ARGB(menu.draws.qcolor[1],menu.draws.qcolor[2],menu.draws.qcolor[3],menu.draws.qcolor[4])\r\n			local r_color = ARGB(menu.draws.rcolor[1],menu.draws.rcolor[2],menu.draws.rcolor[3],menu.draws.rcolor[4])\r\n			\r\n			\r\n			if r_dmg_perc < 100 then\r\n				if q_dmg_perc+r_dmg_perc < 100 then\r\n					DrawLine(baseX, baseY, baseX+r_dmg_perc*1.05, baseY, 12, r_color)\r\n				else\r\n					DrawLine(baseX, baseY, baseX+r_dmg_perc*1.05, baseY, 3, r_color)\r\n				end\r\n			else\r\n				DrawLine(baseX, baseY, baseX+105, baseY, 3, r_color)\r\n			end\r\n			\r\n			local q_start = baseX+r_dmg_perc*1.05\r\n			\r\n			if q_dmg_perc < 100 then\r\n				if r_dmg_perc+q_dmg_perc < 100 then\r\n					DrawLine(q_start, baseY, q_start+q_dmg_perc*1.05, baseY, 12, q_color)\r\n				else\r\n					DrawLine(baseX, baseY-4, baseX+q_dmg_perc*1.05, baseY-4, 3, q_color)\r\n				end\r\n			else\r\n				DrawLine(baseX, baseY-4, baseX+105, baseY-4, 3, q_color)\r\n			end\r\n			\r\n			if q_dmg_perc+r_dmg_perc >= 100 then\r\n				local text = "Killable"\r\n				DrawText(text, 16, baseX+35, baseY-9, ARGB(255,255,255,255))\r\n			end\r\n		end\r\n	end\r\nend\r\n--END DRAWS\r\n\r\nAddLoadCallback(function()\r\n	if not GetOrbWalker() then return end\r\n	Menu()\r\n	Update()\r\nend)\r\n\r\nAddDrawCallback(function()\r\n	if not LoadedWalker then return end\r\n	drawDebugStuff()\r\n	drawdmg()\r\nend)\r\n\r\nAddTickCallback(function()\r\n	if not LoadedWalker then return end\r\n	AutoStun()\r\n	Killsteal()\r\n	Modes()\r\n	jm_instance:update()\r\n	mm_instance:update()\r\n	ts_instance:update()\r\nend)');
INSERT INTO `RandomBundle_Versions` (`ID`, `Name`, `Version`, `File`) VALUES
(6, 'Syndra', 1.1, '--Author: S1mple\r\n--[[\r\n   _____ _        _____           _        _      _____               \r\n  / ____| |      |  __ \\         | |      | |    / ____|              \r\n | (___ | |      | |__) |_ _  ___| | _____| |_  | |     ___  _ __ ___ \r\n  \\___ \\| |      |  ___/ _` |/ __| |/ / _ \\ __| | |    / _ \\| \'__/ _ \\\r\n  ____) | |____  | |  | (_| | (__|   <  __/ |_  | |___| (_) | | |  __/\r\n |_____/|______| |_|   \\__,_|\\___|_|\\_\\___|\\__|  \\_____\\___/|_|  \\___|\r\n                                                                      \r\n                                                                      \r\n--]]\r\nrequire("FHPrediction")\r\nlocal ts_instance = TargetSelector(TARGET_PRIORITY, 4000)\r\nlocal mm_instance = minionManager(MINION_ENEMY, 1500, player, MINION_SORT_HEALTH_ASC)\r\nlocal jm_instance = minionManager(MINION_JUNGLE, 1500, player, MINION_SORT_HEALTH_ASC)\r\n\r\nlocal enemy_heroes = GetEnemyHeroes()\r\nlocal script_version = 1.1\r\nlocal min_log_level = 2\r\nlocal menu\r\nlocal oldprint = print\r\nlocal print = function(arg,loglevel)\r\n\r\n	if(loglevel and loglevel < min_log_level) then\r\n		return\r\n	elseif not loglevel then\r\n		loglevel = 2\r\n	end\r\n	\r\n	local ll = {\r\n		"/DEBUG",\r\n		"/Information",\r\n		"/Warning",\r\n		"/Error",\r\n	}\r\n	oldprint(\'<font color=\\"#808080\\">S1mple_Loader </font><font color=\\"#10FFFF\\">[\'..myHero.charName..(ll[loglevel] and ll[loglevel] or "")..\']</font><font color=\\"#515151\\"> - </font><font color=\\"#FFFFFF\\">\'..tostring(arg)..\'</font>\')\r\nend\r\n\r\nlocal function TCPGetRequest(server, path, data, port)\r\n	local start_t = os.clock()\r\n	local port = port or 80\r\n	local data = data or {}\r\n	local lua_socket = require("socket")\r\n	local connection_tcp = lua_socket.connect(server,port)\r\n	local requeststring = "GET "..path\r\n	local first = true\r\n\r\n	for i,v in pairs(data) do\r\n		requeststring = requeststring..(first and "?" or "&")..i.."="..v\r\n		first = false\r\n	end\r\n	\r\n	requeststring = requeststring.. " HTTP/1.0\\r\\nHost: "..server.."\\r\\n\\r\\n"\r\n	connection_tcp:send(requeststring)\r\n	local response = ""\r\n	local status\r\n	while true do\r\n		s,status, partial = connection_tcp:receive(\'*a\')\r\n		response = response..(s or partial)\r\n		if(status == "closed" or status == "timeout")then\r\n			break\r\n		end\r\n	end\r\n	local end_t = os.clock()\r\n	local start_content = response:find("\\r\\n\\r\\n")+4\r\n	response = response:sub(start_content)\r\n	return response, status, end_t-start_t\r\nend\r\n\r\nlocal function GetWebFile(server, path, data, localfilename, port)\r\n	local r,s,t = TCPGetRequest(server, path, data, port)\r\n	local a,b = Base64Decode(r)\r\n	if (a ~= "No_new_version" and a ~= "Invalid Request" and a ~= "MYSQL Error" and a ~= "") then\r\n		local file = io.open(localfilename,"w+b")\r\n		file:write(a)\r\n		file:close()\r\n		return true\r\n	else\r\n		if a ~= "No_new_version" then\r\n			print(a, 4)\r\n		end\r\n		return false\r\n	end\r\nend\r\n\r\nlocal function Update()\r\n	if(menu.autoupdate)then\r\n		if(GetWebFile("s1mplescripts.de","/S1mple/Scripts/BolStudio/RandomBundle/index.php", {fn = myHero.charName, v = script_version}, LIB_PATH.."SL"..myHero.charName..".lua"))then\r\n			print("Updated, please reload",2)\r\n		else\r\n			print("No update found",2)\r\n		end\r\n	else\r\n		print("Updates disabled", 3)\r\n	end\r\nend\r\n\r\n--[[\r\n--]]\r\n\r\nlocal got_w_buff = false\r\nlocal orbs = {}\r\n\r\nlocal function Menu()\r\n	menu = scriptConfig("Simple Loader ["..myHero.charName.."]", "SL"..myHero.charName)\r\n	menu:addSubMenu("Advanced Settings", "adv") --DONE\r\n		menu.adv:addParam("debuglvl", "Debug Level", SCRIPT_PARAM_LIST, 2, {"DEBUG", "Information", "Warning", "Error"}) --DONE\r\n		menu.adv:setCallback("debuglvl", function(value) --DONE\r\n			min_log_level = value\r\n		end)\r\n		min_log_level = menu.adv.debuglvl\r\n		\r\n	--Champ Specific\r\n\r\n	menu:addSubMenu("Key Settings", "key")\r\n		menu.key:addParam("Info", "Orbwalkers keys integrated with", SCRIPT_PARAM_INFO, "")\r\n    	menu.key:addParam("Info", "your orbwalker.", SCRIPT_PARAM_INFO, "")\r\n\r\n	menu:addSubMenu("Spell Settings", "spells")\r\n		menu.spells:addSubMenu("Q", "q")\r\n\r\n			menu.spells.q:addParam("Blank", "    General", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.q:addParam("onc", "Use on Combo", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.q:addParam("manaonc", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 0, 0, 100, 0)\r\n			menu.spells.q:addParam("usemec", "Use MEC in Combo", SCRIPT_PARAM_ONOFF, false)\r\n			\r\n			menu.spells.q:addParam("Blank", "", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.q:addParam("onf", "Use on LaneClear", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.q:addParam("manaonf", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 20, 0, 100, 0)\r\n\r\n			menu.spells.q:addParam("Blank", "", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.q:addParam("onh", "Use on Harras", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.q:addParam("manaonh", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 20, 0, 100, 0)\r\n\r\n		menu.spells:addSubMenu("W", "w")\r\n\r\n			menu.spells.w:addParam("Blank", "    General", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.w:addParam("onc", "Use on Combo", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.w:addParam("manaonc", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 0, 0, 100, 0)\r\n\r\n			menu.spells.w:addParam("Blank", "", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.w:addParam("onf", "Use on LaneClear", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.w:addParam("manaonf", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 20, 0, 100, 0)\r\n\r\n			menu.spells.w:addParam("Blank", "", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.w:addParam("onh", "Use on Harras", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.w:addParam("manaonh", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 20, 0, 100, 0)\r\n\r\n		menu.spells:addSubMenu("E", "e")\r\n\r\n			menu.spells.e:addParam("Blank", "    General", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.e:addParam("onc", "Use on Combo", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.e:addParam("manaonc", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 0, 0, 100, 0)\r\n\r\n			menu.spells.e:addParam("Blank", "", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.e:addParam("onf", "Use on LaneClear", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.e:addParam("manaonf", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 20, 0, 100, 0)\r\n\r\n			menu.spells.e:addParam("Blank", "", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.e:addParam("onh", "Use on Harras", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.e:addParam("manaonh", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 20, 0, 100, 0)\r\n\r\n\r\n		menu.spells:addSubMenu("R", "r") --tbd\r\n\r\n			menu.spells.r:addParam("Blank", "    General", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.r:addParam("onc", "Use on Combo", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.r:addParam("manaonc", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 0, 0, 100, 0)\r\n			menu.spells.r:addParam("killonlyc", "Only if killable", SCRIPT_PARAM_ONOFF, true)\r\n\r\n			menu.spells.r:addParam("Blank", "", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.r:addParam("onh", "Use on Harras", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.r:addParam("manaonh", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 20, 0, 100, 0)\r\n			menu.spells.r:addParam("killonlyh", "Only if killable", SCRIPT_PARAM_ONOFF, true)\r\n\r\n\r\n		menu.spells:addSubMenu("Q/E", "qe")\r\n\r\n			menu.spells.qe:addParam("Blank", "    General", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.qe:addParam("onc", "Use on Combo", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.qe:addParam("manaonc", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 0, 0, 100, 0)\r\n			\r\n			menu.spells.qe:addParam("Blank", "", SCRIPT_PARAM_INFO, "")\r\n			menu.spells.qe:addParam("onh", "Use on Harras", SCRIPT_PARAM_ONOFF, true)\r\n			menu.spells.qe:addParam("manaonh", "If My Mana Percent > %X", SCRIPT_PARAM_SLICE, 20, 0, 100, 0)\r\n\r\n	menu:addSubMenu("Killsteal", "ks")\r\n		menu.ks:addParam("q", "Killsteal with Q", SCRIPT_PARAM_ONOFF, true)\r\n		menu.ks:addParam("w", "Killsteal with W", SCRIPT_PARAM_ONOFF, true)\r\n		menu.ks:addParam("e", "Killsteal with E", SCRIPT_PARAM_ONOFF, true)\r\n		menu.ks:addParam("r", "Killsteal with R", SCRIPT_PARAM_ONOFF, true)\r\n\r\n    menu:addSubMenu("Drawings", "draws")\r\n    	menu.draws:addParam("target", "Draw Target", SCRIPT_PARAM_ONOFF, true)\r\n	--End Champ Specific\r\n\r\n		menu:addSubMenu("Skin Changer", "sc")\r\n		menu.sc:addParam("activehero", "Active (Hero)", SCRIPT_PARAM_ONOFF, false)\r\n		menu.sc:addParam("heroskin", "Choose Skin (Hero)", SCRIPT_PARAM_LIST,1, {"Classic", "Justicar","Atlantean","Queen of Diamonds", "Snow Day"})\r\n		menu.sc:setCallback("activehero", function (value)\r\n			if(value == false)then\r\n				SetSkin(myHero, 0)\r\n			else				\r\n				SetSkin(myHero, menu.sc.heroskin-1)\r\n			end\r\n		end)\r\n		menu.sc:setCallback("heroskin", function (value)\r\n			if(menu.sc.activehero)then\r\n				SetSkin(myHero, value-1)\r\n			end\r\n		end)\r\n		if(menu.sc.activehero)then\r\n			SetSkin(myHero, menu.sc.heroskin-1)\r\n		end\r\n	\r\n	menu:addParam("autoupdate","Autoupdate", SCRIPT_PARAM_ONOFF, true) --DONE\r\n	menu:addParam("version", "Version: ", SCRIPT_PARAM_INFO, script_version) --DONE\r\nend\r\n\r\nlocal LoadedWalker\r\nlocal function GetOrbWalker()\r\n	if _G.S1OrbLoading or _G.S1mpleOrbLoaded then LoadedWalker = "S1Orb" end\r\n	if _G.Reborn_Loaded or _G.AutoCarry then LoadedWalker = "SAC:R" end\r\n	if SAC then LoadedWalker = "SAC:P" end\r\n	if _Pewalk then LoadedWalker = "PEW" end\r\n	if _G.NebelwolfisOrbWalkerInit then LoadedWalker = "NOW" end\r\n	if not LoadedWalker then print("You need to load an OrbWalker to load this Script",4) return false end\r\n	return true\r\nend\r\n\r\n\r\nlocal function GetOrbMode()\r\n	if LoadedWalker == "S1Orb" then\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "none" then return 0 end\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "harass" then return 1 end\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "laneclear" then return 2 end\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "lasthit" then return 3 end\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "sbtw" then return 4 end\r\n	elseif LoadedWalker == "SAC:R" then\r\n		if not _G.AutoCarry or not _G.AutoCarry.Keys then return 0 end\r\n		if _G.AutoCarry.Keys.MixedMode then return 1 end\r\n		if _G.AutoCarry.Keys.LaneClear then return 2 end\r\n		if _G.AutoCarry.Keys.LastHit then return 3 end\r\n		if _G.AutoCarry.Keys.AutoCarry then return 4 end\r\n	elseif LoadedWalker == "SAC:P" then\r\n		if SAC:GetActiveMode() == "MixedMode" then return 1 end\r\n		if SAC:GetActiveMode() == "Laneclear" then return 2 end\r\n		if SAC:GetActiveMode() == "LastHit" then return 3 end\r\n		if SAC:GetActiveMode() == "AutoCarry" then return 4 end		\r\n	elseif LoadedWalker == "PEW" then\r\n		if not _Pewalk then return 0 end\r\n		if _Pewalk.GetActiveMode().Mixed then return 1 end\r\n		if _Pewalk.GetActiveMode().LaneClear then return 2 end\r\n		if _Pewalk.GetActiveMode().Farm then return 3 end\r\n		if _Pewalk.GetActiveMode().Carry then return 4 end\r\n	elseif LoadedWalker == "NOW" then\r\n		if not _G.NebelwolfisOrbWalkerInit then return 0 end\r\n		if _G.NebelwolfisOrbWalker.mode == "Mixed" then return 1 end\r\n		if _G.NebelwolfisOrbWalker.mode == "LaneClear" then return 2 end		\r\n		if _G.NebelwolfisOrbWalker.mode == "LastHit" then return 3 end	\r\n		if _G.NebelwolfisOrbWalker.mode == "Combo" then return 4 end\r\n	end\r\n\r\n	return 0\r\nend\r\n\r\nlocal function GetOrbTarget()\r\n	if LoadedWalker == "S1Orb" then\r\n		return (_G.S1mpleOrbLoaded and _G.S1:GetTarget() or nil)\r\n	elseif LoadedWalker == "SAC:R" and _G.AutoCarry and _G.AutoCarry.SkillsCrosshair then\r\n		return _G.AutoCarry.SkillsCrosshair.target\r\n	elseif LoadedWalker == "SAC:P" then\r\n		return SAC:GetTarget()\r\n	elseif LoadedWalker == "PEW" then\r\n		return _Pewalk.GetTarget()\r\n	elseif LoadedWalker == "NOW" then\r\n		return _G.NebelwolfisOrbWalker:GetTarget()\r\n	end\r\nend\r\n\r\nlocal function GetCTarget(range)\r\n	if not range then range = myHero.range end\r\n	local target = GetOrbTarget()\r\n	if not target or GetDistance(target) > range then\r\n		local mode = GetOrbMode()\r\n		if mode == 1 then -- Mixed Mode (Harras)\r\n			ts_instance.range = range\r\n			target = ts_instance.target\r\n			ts_instance.range = 4000\r\n			if not target then\r\n				mm_instance.range = range\r\n				target = mm_instance.objects[1]\r\n				mm_instance.range = 1500\r\n			end\r\n			if not target then\r\n				jm_instance.range = range\r\n				target = jm_instance.objects[1]\r\n				jm_instance.range = 1500\r\n			end\r\n		elseif mode == 2 then -- LaneClear\r\n			mm_instance.range = range\r\n			target = mm_instance.objects[1]\r\n			mm_instance.range = 4000\r\n			if not target then\r\n				jm_instance.range = range\r\n				target = jm_instance.objects[1]\r\n				jm_instance.range = 1500\r\n			end\r\n		elseif mode == 3 then -- LastHit\r\n			mm_instance.range = range\r\n			target = mm_instance.objects[1]\r\n			mm_instance.range = 1500		\r\n			if not target then\r\n				jm_instance.range = range\r\n				target = jm_instance.objects[1]\r\n				jm_instance.range = 1500\r\n			end\r\n		elseif mode == 4 then --SBTW\r\n			ts_instance.range = range\r\n			target = ts_instance.target\r\n			ts_instance.range = 400\r\n		end			\r\n	end\r\n	\r\n	return target\r\nend\r\n\r\n\r\n--MATH\r\nlocal sqrt = math.sqrt\r\nlocal function CalcVector(source,target)\r\n	local V = Vector(source.x, source.y, source.z)\r\n	local V2 = Vector(target.x, target.y, target.z)\r\n	local vec = V-V2\r\n	local vec2 = vec:normalized()\r\n	return vec2\r\nend\r\n\r\n--[[\r\nlocal function GetDistance(p1, p2)\r\n	if not p1 then oldprint(debug.getinfo(2)) end \r\n	p2 = p2 or player\r\n    local s = (p1.x - p2.x) ^ 2 + ((p1.z or p1.y) - (p2.z or p2.y)) ^ 2\r\n	return sqrt(s)\r\nend\r\n]]\r\n--END MATH\r\n\r\nlocal function GetMana()\r\n	return myHero.mana/myHero.maxMana*100	\r\nend\r\n\r\nlocal function _CalcSpellPosForGroup(radius, range, points)\r\n    if #points == 0 then\r\n        return nil\r\n    elseif #points == 1 then\r\n        return {center = Vector(points[1]), radius = nil}\r\n    end\r\n    local mec = MEC()\r\n    local combos = {}\r\n    for j = #points, 2, -1 do\r\n        local spellPos\r\n        combos[j] = {}\r\n        _CalcCombos(j, points, combos[j])\r\n        for _, v in ipairs(combos[j]) do\r\n            mec:SetPoints(v)\r\n            local c = mec:Compute()\r\n            if c ~= nil and c.radius <= radius and c.center:dist(player) <= range and (spellPos == nil or c.radius < spellPos.radius) then\r\n                spellPos = {center = c.center, radius = c.radius}\r\n            end\r\n        end\r\n        if spellPos ~= nil then return spellPos end\r\n    end\r\nend\r\n\r\nlocal function GetDmg(spell, unit)\r\n	if unit and unit.visible and not unit.dead and unit.bTargetable then\r\n\r\n		local ADDmg = 0\r\n		local APDmg = 0\r\n\r\n		local Level = myHero.level\r\n		local TotalDmg = myHero.totalDamage\r\n		local AddDmg = myHero.addDamage\r\n		local AP = myHero.ap\r\n		local ArmorPen = myHero.armorPen\r\n		local ArmorPenPercent = myHero.armorPenPercent\r\n		local MagicPen = myHero.magicPen\r\n		local MagicPenPercent = myHero.magicPenPercent\r\n\r\n		local Armor = math.max(0, unit.armor*ArmorPenPercent-ArmorPen)\r\n		local ArmorPercent = Armor/(100+Armor)\r\n		local MagicArmor = math.max(0, unit.magicArmor*MagicPenPercent-MagicPen)\r\n		local MagicArmorPercent = MagicArmor/(100+MagicArmor)\r\n\r\n		if spell == "AA" then\r\n			ADDmg = TotalDmg\r\n		elseif spell == "Q" then\r\n			if myHero:CanUseSpell(_Q) == READY then\r\n				APDmg = 45*myHero:GetSpellData(_Q).level+5+0.75*AP\r\n			end\r\n		elseif spell == "W" then\r\n			if myHero:CanUseSpell(_W) == READY then\r\n				APDmg = 40*myHero:GetSpellData(_W).level+40+0.8*AP	\r\n			end\r\n		elseif spell == "E" then\r\n			if myHero:CanUseSpell(_E) == READY then\r\n				APDmg = 45*myHero:GetSpellData(_W).level+25+0.5*AP			\r\n			end\r\n		elseif spell == "R" then\r\n			if myHero:CanUseSpell(_R) == READY then\r\n				local spheres = math.min(3+#orbs,7)\r\n				local DmgperSphere = 45*myHero:GetSpellData(_R).level+45+0.2*AP\r\n				local SphereDamage = DmgperSphere*spheres\r\n				APDmg = 135*myHero:GetSpellData(_R).level+270+0.6*AP+SphereDamage\r\n				APDmg = APDmg*0.9\r\n			end\r\n		end\r\n\r\n		local TrueDmg = ADDmg*(1-ArmorPercent)+APDmg*(1-MagicArmorPercent)\r\n		return TrueDmg\r\n	end\r\n	return 0\r\nend\r\n\r\nlocal Qdata = {\r\n	range = 790,\r\n	speed = math.huge,\r\n	delay = 0.6,\r\n	radius = 125\r\n}\r\n\r\nlocal Wdata = {\r\n	range = 950,\r\n	speed = 1450,\r\n	delay = 0.25,\r\n	radius = 210\r\n}\r\n\r\nlocal QEdata = {\r\n	range = 1290,\r\n	speed = 9000,\r\n	delay = 0.98,\r\n	radius = 55\r\n}\r\n\r\nlocal ValidTarget = ValidTarget\r\n\r\nlocal ex_draw_table = {}\r\n\r\nlocal function CastQ(target)\r\n	if --[[target and target.valid and not target.dead and target.visible--]] ValidTarget(target) then\r\n		local CastPos, HitChance, _ = FHPrediction.GetPrediction("Q", target)\r\n		if CastPos and HitChance > 1.1 then\r\n			CastSpell(_Q, CastPos.x, CastPos.z)\r\n			return true\r\n		end\r\n	end\r\nend\r\n\r\nlocal function CastQPos(mode)\r\n	local x = {}\r\n	local objs = {}\r\n	if mode == 1 then\r\n		objs = mm_instance.objects\r\n	elseif mode == 2 then\r\n		objs = GetEnemyHeroes()\r\n	end\r\n	for k,v in pairs(objs) do\r\n		if --[[v and v.valid and not v.dead and v.visible and GetDistance(v) <=970--]] ValidTarget(v, 970) then\r\n			x[#x+1] = v\r\n			if #x > 7 then break end\r\n		end\r\n	end\r\n	if #x >= 1 then\r\n\r\n		local a = _CalcSpellPosForGroup(170,800,x)\r\n		if a ~= nil then\r\n			local center = a.center\r\n			local radius = a.radius\r\n			CastSpell(_Q, center.x, center.z)\r\n			ex_draw_table["Q"] = nil\r\n			ex_draw_table["Q"] = a\r\n		end\r\n	end\r\nend\r\n\r\nlocal function CastWPos(mode)\r\n	local x = {}\r\n	local objs = {}\r\n	if mode == 1 then\r\n		objs = mm_instance.objects\r\n	elseif mode == 2 then\r\n		objs = GetEnemyHeroes()\r\n	end\r\n	for k,v in pairs(objs) do\r\n		if --[[v and v.valid and not v.dead and v.visible and GetDistance(v) <=1160--]] ValidTarget(v, 1160) then\r\n			x[#x+1] = v\r\n			if #x > 7 then break end\r\n		end\r\n	end\r\n	if #x >= 1 then\r\n\r\n		local a = _CalcSpellPosForGroup(210,950,x)\r\n		if a ~= nil then\r\n			local center = a.center\r\n			local radius = a.radius\r\n			CastSpell(_W, center.x, center.z)\r\n			ex_draw_table["W"] = nil\r\n			ex_draw_table["W"] = a\r\n		end\r\n	end\r\nend\r\n\r\nlocal function CastW(target)\r\n	if --[[target and target.valid and not target.dead and target.visible--]] ValidTarget(target) then\r\n		local CastPos, HitChance, _ = FHPrediction.GetPrediction(Wdata, target)\r\n		if CastPos and HitChance >= 1 then\r\n			CastSpell(_W, CastPos.x, CastPos.z)\r\n		end\r\n	end\r\nend\r\n\r\n\r\nlocal function CastE(target)\r\n	if --[[target and target.valid and not target.dead and target.visible--]] ValidTarget(target) then\r\n		if got_w_buff then return end\r\n\r\n		if target and GetDistance(target) < GetDistance(myHero) then\r\n			local CastPos, HitChance, _ = FHPrediction.GetPrediction("E", target)\r\n			if CastPos and HitChance > 1 then\r\n				CastSpell(_E, CastPos.x, CastPos.z)\r\n			end\r\n		end\r\n	end\r\nend\r\n\r\nlocal function CastR(target)\r\n	if --[[target and target.valid and not target.dead and target.visible--]] ValidTarget(target) then\r\n		CastSpell(_R, target)\r\n	end\r\nend\r\n\r\nlocal function QENeededMana()\r\n	local q_lvl = myHero:GetSpellData(_Q).level\r\n	local q_mana = (q_lvl*10)+60\r\n	local e_mana = 50\r\n	if (q_mana+e_mana <= myHero.mana) then\r\n		return true\r\n	else\r\n		return false\r\n	end\r\nend\r\n\r\nlocal function predictPosition(o, spelldata)\r\n	if not o or not spelldata then\r\n		return Vector(0,0,0), -1\r\n	end\r\n	\r\n	if o.hasMovePath and o.path.valid and o.path.count > 1 then\r\n		local prev_waypoint = nil\r\n		local max_hit_time = spelldata.radius/o.ms\r\n		for i=0, o.path.count do\r\n			local waypoint = o.path:Path(i)\r\n			if waypoint then\r\n\r\n				if i == o.path.curPath then\r\n					if prev_waypoint then\r\n						\r\n						local dst_o_wp = GetDistance(o, waypoint)\r\n						local traveltime_o = dst_o_wp/o.ms\r\n						local missle_dst = GetDistance(myHero, waypoint)\r\n						local traveltime_m = missle_dst/spelldata.speed						\r\n						local a,b = VectorMovementCollision(o, waypoint, o.ms, myHero, spelldata.speed, spelldata.delay)\r\n						local castPos = Vector(b.x, o.y, b.y)						\r\n						local mt_VMC = GetDistance(myHero, castPos)/spelldata.speed\r\n						local ot_VMC = GetDistance(o, castPos)/o.ms						\r\n						if GetDistance(castPos) < spelldata.range + spelldata.radius then\r\n							return castPos, 1-math.max(GetDistance(castPos)/spelldata.range,0)\r\n						else\r\n							return Vector(0,0,0), -1							\r\n						end\r\n					end\r\n				else\r\n					prev_waypoint = waypoint\r\n				end\r\n			end\r\n		end\r\n	else\r\n		return Vector(o.x, o.y, o.z), 1\r\n	end\r\n	return Vector(0,0,0), -1\r\nend\r\n\r\nlocal function CastQE(target)\r\n	if --[[target and target.valid and not target.dead and target.bTargetable--]] ValidTarget(target) then\r\n		local predPos, hitchance = predictPosition(target, QEdata)\r\n		if predPos and hitchance and hitchance > 0 and predPos ~= Vector(0,0,0) then\r\n			if GetDistance(predPos) < 700 then\r\n				CastSpell(_Q, predPos.x, predPos.z)\r\n				CastSpell(_E, predPos.x, predPos.z)\r\n			else\r\n				local myPos = Vector(myHero.x, myHero.y, myHero.z)\r\n				local vec = CalcVector(myPos, predPos)*700*-1\r\n				CastSpell(_Q, vec.x, vec.z)\r\n				CastSpell(_E, vec.x, vec.z)\r\n			end\r\n		end\r\n	end\r\nend\r\n\r\n-- NORMAL MODES\r\nlocal function Combo()\r\n	local Target = GetCTarget(1290)\r\n	if not Target then return end\r\n\r\n	if myHero:CanUseSpell(_Q) and myHero:CanUseSpell(_E) and menu.spells.qe.onc and menu.spells.qe.manaonc <= GetMana() then\r\n		if QENeededMana() then\r\n			CastQE(Target)\r\n		end\r\n	end\r\n\r\n	if myHero:CanUseSpell(_Q) == READY and menu.spells.q.onc and menu.spells.q.manaonc <= GetMana() then\r\n		if menu.spells.q.usemec then\r\n			CastQPos(2)\r\n		else\r\n			CastQ(Target)\r\n		end\r\n	end\r\n\r\n	if myHero:CanUseSpell(_W) == READY and menu.spells.w.onc and (menu.spells.w.manaonc <= GetMana() or TargetHaveBuff("syndrawtooltip")) then\r\n		CastW(Target)\r\n	end\r\n\r\n	if myHero:CanUseSpell(_E) == READY and menu.spells.e.onc and menu.spells.e.manaonc <= GetMana() then\r\n		CastE(Target)\r\n	end\r\n	\r\n	if myHero:CanUseSpell(_R) == READY and menu.spells.r.onc and menu.spells.r.manaonc <= GetMana() then\r\n		if menu.spells.r.killonlyc then\r\n			local dmg = GetDmg("R", Target)\r\n			if dmg >= Target.health then\r\n				print(dmg, 1)\r\n				print(Target.health,1)\r\n				CastR(Target)\r\n			end\r\n		else\r\n			CastR(Target)\r\n		end\r\n	end\r\nend\r\n\r\nlocal function Harras()\r\n	local Target = GetCTarget(1290)\r\n	if not Target or Target.type ~= myHero.type then return end\r\n\r\n	if myHero:CanUseSpell(_Q) == READY and menu.spells.q.onh and menu.spells.q.manaonh <= GetMana() then\r\n		CastQ(Target)\r\n	end\r\n\r\n	if myHero:CanUseSpell(_W) == READY and menu.spells.w.onh and (menu.spells.w.manaonh <= GetMana() or TargetHaveBuff("syndrawtooltip")) then\r\n		CastW(Target)\r\n	end\r\n\r\n	if myHero:CanUseSpell(_E) == READY and menu.spells.e.onh and menu.spells.e.manaonh <= GetMana() then\r\n		CastE(Target)\r\n	end\r\n	\r\n	if myHero:CanUseSpell(_R) == READY and menu.spells.r.onh and menu.spells.r.manaonh <= GetMana() then\r\n		if menu.spells.r.killonlyh then\r\n			local dmg = GetDmg("R", Target)\r\n			if dmg >= Target.health then\r\n				CastR(Target)\r\n			end\r\n		else\r\n			CastR(Target)\r\n		end\r\n	end\r\nend\r\n\r\nlocal function Laneclear()\r\n	local Target = GetCTarget(1290)\r\n	if not Target then return end\r\n\r\n	if myHero:CanUseSpell(_Q) == READY and menu.spells.q.onf and menu.spells.q.manaonf <= GetMana() then\r\n		CastQPos(1)\r\n	end\r\n\r\n	if myHero:CanUseSpell(_W) == READY and menu.spells.w.onf and (menu.spells.w.manaonf <= GetMana() or TargetHaveBuff("syndrawtooltip")) then\r\n		CastWPos(1)\r\n	end\r\n\r\n	if myHero:CanUseSpell(_E) == READY and menu.spells.e.onf and menu.spells.e.manaonf <= GetMana() then\r\n		CastE(Target)\r\n	end\r\nend\r\n\r\nlocal function Modes()\r\n	local mode = GetOrbMode()\r\n	if mode == 4 then\r\n		Combo()\r\n	elseif mode == 1 then\r\n		Harras()\r\n	elseif mode == 2 then\r\n		Laneclear()\r\n	end\r\nend\r\n\r\n--END NORMAL MODES\r\n\r\nfunction OrbManager_add(obj)\r\n	if obj and obj.name and obj.name == "Seed" and obj.type == "obj_AI_Minion" then\r\n		orbs[#orbs+1] = obj\r\n	end\r\nend\r\nfunction OrbManager_del(obj)\r\n	if obj and obj.name and obj.name == "Seed" and obj.type == "obj_AI_Minion" then\r\n		orbs[#orbs+1] = obj\r\n	end\r\nend\r\n\r\n\r\nlocal function Killsteal()\r\n	local q_ks = menu.ks.q\r\n	local w_ks = menu.ks.w\r\n	local e_ks = menu.ks.e\r\n	local r_ks = menu.ks.r\r\n	\r\n	if q_ks or w_ks or e_ks or r_ks then\r\n		for _,v in pairs(enemy_heroes) do\r\n			if --[[v and v.valid and v.visible and not v.dead and v.bTargetable--]] ValidTarget(v) then\r\n				if q_ks and GetDistance(800) and myHero:CanUseSpell(_Q) then\r\n					if GetDmg("Q",v) > v.health then\r\n						CastQ(v)\r\n						break\r\n					end\r\n				end\r\n				if w_ks and GetDistance(950) and myHero:CanUseSpell(_W) then\r\n					if GetDmg("W",v) > v.health then\r\n						CastW(v)\r\n						break\r\n					end\r\n				end\r\n				if e_ks and GetDistance(700) and myHero:CanUseSpell(_E) then\r\n					if GetDmg("E",v) > v.health then\r\n						CastE(v)\r\n						break\r\n					end\r\n				end\r\n				if r_ks and GetDistance(675) and myHero:CanUseSpell(_R) then\r\n					if GetDmg("R",v) > v.health then\r\n						CastR(v)\r\n						break\r\n					end\r\n				end\r\n			end\r\n		end		\r\n	end\r\nend\r\n\r\n\r\n--BEGIN DRAWS\r\nlocal function Draws()\r\n	if menu.draws.target then\r\n		local t = GetCTarget(1290)\r\n		if t then\r\n			DrawCircle3D(t.x, t.y, t.z,50,2,ARGB(255,255,0,255))\r\n		end\r\n\r\n		if ex_draw_table["Q"] then\r\n			local a = ex_draw_table["Q"]\r\n			local center = a.center\r\n			local radius = a.radius\r\n			if center and radius then\r\n				DrawCircle3D(center.x,center.y,center.z, radius, 1, ARGB(255,255,0,128))\r\n			end\r\n		end\r\n\r\n		if ex_draw_table["W"] then\r\n			local a = ex_draw_table["W"]\r\n			local center = a.center\r\n			local radius = a.radius\r\n			if center and radius then\r\n				DrawCircle3D(center.x,center.y,center.z, radius, 1, ARGB(255,255,0,128))\r\n			end\r\n		end\r\n\r\n		if myHero:CanUseSpell(_R)then\r\n			for k,v in pairs(GetEnemyHeroes()) do\r\n				DrawText3D(tostring(GetDmg(v)), v.x, v.y, v.z)\r\n			end\r\n		end\r\n	end\r\nend\r\n\r\nlocal function drawDebugStuff()\r\n	if min_log_level > 1 then return end\r\n\r\nend\r\n--END DRAWS\r\n\r\nAddLoadCallback(function()\r\n	if not GetOrbWalker() then return end\r\n	Menu()\r\n	Update()\r\nend)\r\n\r\nAddDrawCallback(function()\r\n	if not LoadedWalker then return end\r\n	Draws()\r\nend)\r\n\r\nAddTickCallback(function()\r\n	if not LoadedWalker then return end\r\n	ts_instance:update()\r\n	jm_instance:update()\r\n	mm_instance:update()\r\n	Modes()\r\nend)\r\n\r\nAddProcessSpellCallback(function(unit, spell)\r\n	if not LoadedWalker then return end\r\nend)\r\n\r\nAddCreateObjCallback(function(object)\r\n	if not LoadedWalker then return end\r\n	OrbManager_add(object)\r\nend)\r\n\r\nAddDeleteObjCallback(function (obj)\r\n	if not LoadedWalker then return end\r\n	OrbManager_del(object)\r\nend)\r\n\r\nAddBugsplatCallback(function ()\r\n	local file = io.open(SCRIPT_PATH.."SLSyndra.bugsplat", "a")\r\n	file:write(tostring(debug.traceback()))\r\n	file:close()\r\nend)\r\n\r\nAddRemoveBuffCallback(function (a,b)\r\n	if a.isMe and b.name == "syndrawtooltip" then\r\n		got_w_buff = false\r\n	end\r\nend)\r\n\r\nAddApplyBuffCallback(function (a,b,c)\r\n	if a.isMe and c.name == "syndrawtooltip" then\r\n		got_w_buff = true\r\n	end\r\nend)'),
(7, 'Nami', 0, ''),
(8, 'Jhin', 0, '');
INSERT INTO `RandomBundle_Versions` (`ID`, `Name`, `Version`, `File`) VALUES
(2, 'AurelionSol', 2, '--Author: S1mple\r\n--[[\r\n   _____ _        _____           _        _      _____               \r\n  / ____| |      |  __ \\         | |      | |    / ____|              \r\n | (___ | |      | |__) |_ _  ___| | _____| |_  | |     ___  _ __ ___ \r\n  \\___ \\| |      |  ___/ _` |/ __| |/ / _ \\ __| | |    / _ \\| \'__/ _ \\\r\n  ____) | |____  | |  | (_| | (__|   <  __/ |_  | |___| (_) | | |  __/\r\n |_____/|______| |_|   \\__,_|\\___|_|\\_\\___|\\__|  \\_____\\___/|_|  \\___|\r\n                                                                      \r\n                                                                      \r\n--]]\r\nrequire("FHPrediction")\r\nlocal ts_instance = TargetSelector(TARGET_PRIORITY, 4000)\r\nlocal mm_instance = minionManager(MINION_ENEMY, 1500, player, MINION_SORT_HEALTH_ASC)\r\nlocal jm_instance = minionManager(MINION_JUNGLE, 1500, player, MINION_SORT_HEALTH_ASC)\r\n\r\nlocal enemy_heroes = GetEnemyHeroes()\r\nlocal script_version = 2.0\r\nlocal min_log_level = 2\r\nlocal menu\r\nlocal oldprint = print\r\n\r\nlocal DrawCircle3D = _G.DrawCircle3D\r\nlocal clock = os.clock\r\nlocal ARGB = _G.ARGB\r\nlocal IsGrass = _G.IsGrass\r\n\r\n\r\nlocal print = function(arg,loglevel)\r\n\r\n	if(loglevel and loglevel < min_log_level) then\r\n		return\r\n	elseif not loglevel then\r\n		loglevel = 2\r\n	end\r\n	\r\n	local ll = {\r\n		"/DEBUG",\r\n		"/Information",\r\n		"/Warning",\r\n		"/Error",\r\n	}\r\n	oldprint(\'<font color=\\"#808080\\">S1mple_Loader </font><font color=\\"#10FFFF\\">[\'..myHero.charName..(ll[loglevel] and ll[loglevel] or "")..\']</font><font color=\\"#515151\\"> - </font><font color=\\"#FFFFFF\\">\'..tostring(arg)..\'</font>\')\r\nend\r\n\r\nlocal function TCPGetRequest(server, path, data, port)\r\n	local start_t = clock()\r\n	local port = port or 80\r\n	local data = data or {}\r\n	local lua_socket = require("socket")\r\n	local connection_tcp = lua_socket.connect(server,port)\r\n	local requeststring = "GET "..path\r\n	local first = true\r\n\r\n	for i,v in pairs(data) do\r\n		requeststring = requeststring..(first and "?" or "&")..i.."="..v\r\n		first = false\r\n	end\r\n	\r\n	requeststring = requeststring.. " HTTP/1.0\\r\\nHost: "..server.."\\r\\n\\r\\n"\r\n	connection_tcp:send(requeststring)\r\n	local response = ""\r\n	local status\r\n	while true do\r\n		s,status, partial = connection_tcp:receive(\'*a\')\r\n		response = response..(s or partial)\r\n		if(status == "closed" or status == "timeout")then\r\n			break\r\n		end\r\n	end\r\n	local end_t = clock()\r\n	local start_content = response:find("\\r\\n\\r\\n")+4\r\n	response = response:sub(start_content)\r\n	return response, status, end_t-start_t\r\nend\r\n\r\nlocal function GetWebFile(server, path, data, localfilename, port)\r\n	local r,s,t = TCPGetRequest(server, path, data, port)\r\n	local a,b = Base64Decode(r)\r\n	if (a ~= "No_new_version" and a ~= "Invalid Request" and a ~= "MYSQL Error" and a ~= "") then\r\n		local file = io.open(localfilename,"w+b")\r\n		file:write(a)\r\n		file:close()\r\n		print("Download Finished")\r\n		return true\r\n	else\r\n		if a ~= "No_new_version" then\r\n			print(a, 4)\r\n		end\r\n		return false\r\n	end\r\nend\r\n\r\nlocal function Update()\r\n	if(menu.autoupdate)then\r\n		if(GetWebFile("s1mplescripts.de","/S1mple/Scripts/BolStudio/RandomBundle/index.php", {fn = myHero.charName, v = script_version}, LIB_PATH.."SL"..myHero.charName..".lua"))then\r\n			print("Updated, please reload",2)\r\n		else\r\n			print("No update found",2)\r\n		end\r\n	else\r\n		print("Updates disabled", 3)\r\n	end\r\nend\r\n\r\n--[[\r\n                         _ _                _____       _          _   _             _____ _               ______                        \r\n     /\\                 | (_)              / ____|     | |        | | | |           / ____| |             |  ____|                       \r\n    /  \\  _   _ _ __ ___| |_  ___  _ __   | (___   ___ | |   __   | |_| |__   ___  | (___ | |_ __ _ _ __  | |__ ___  _ __ __ _  ___ _ __ \r\n   / /\\ \\| | | | \'__/ _ \\ | |/ _ \\| \'_ \\   \\___ \\ / _ \\| |  |__|  | __| \'_ \\ / _ \\  \\___ \\| __/ _` | \'__| |  __/ _ \\| \'__/ _` |/ _ \\ \'__|\r\n  / ____ \\ |_| | | |  __/ | | (_) | | | |  ____) | (_) | |        | |_| | | |  __/  ____) | || (_| | |    | | | (_) | | | (_| |  __/ |   \r\n /_/    \\_\\__,_|_|  \\___|_|_|\\___/|_| |_| |_____/ \\___/|_|         \\__|_| |_|\\___| |_____/ \\__\\__,_|_|    |_|  \\___/|_|  \\__, |\\___|_|   \r\n                                                                                                                          __/ |          \r\n                                                                                                                         |___/           \r\n--]]\r\n\r\nlocal function Menu()\r\n	menu = scriptConfig("Simple Loader ["..myHero.charName.."]", "SL"..myHero.charName)\r\n	menu:addSubMenu("Advanced Settings", "adv") --DONE\r\n		menu.adv:addParam("debuglvl", "Debug Level", SCRIPT_PARAM_LIST, 2, {"DEBUG", "Information", "Warning", "Error"}) --DONE\r\n		menu.adv:setCallback("debuglvl", function(value) --DONE\r\n			min_log_level = value\r\n		end)\r\n		min_log_level = menu.adv.debuglvl\r\n		\r\n	--Champ Specific\r\n	menu:addSubMenu("Spell Settings", "spells") --DONE\r\n		menu.spells:addSubMenu("Q", "q") --DONE\r\n			menu.spells.q:addParam("autoqone", "Auto Q on E Cast", SCRIPT_PARAM_ONOFF, true) --DONE\r\n			menu.spells.q:addParam("autoExplode", "Auto 2nd Cast against Champions", SCRIPT_PARAM_ONOFF, true) --DONE\r\n			menu.spells.q:addParam("minautoExplode", "Min Enemy\'s for Auto 2nd Cast", SCRIPT_PARAM_SLICE, 1,1,5,0) --DONE\r\n\r\n		menu.spells:addSubMenu("W", "w") --DONE\r\n			menu.spells.w:addParam("autoscale", "Auto Scale", SCRIPT_PARAM_ONOFF, true) --DONE\r\n			spell_w_ts_list = {"Most", "Lowlife"} --DONE\r\n			menu.spells.w:addParam("ts", "Focus:", SCRIPT_PARAM_LIST,1,spell_w_ts_list) --DONE\r\n			menu.spells.w:addParam("autosmallon", "Auto Shrink if no Enemy", SCRIPT_PARAM_ONOFF, true) --DONE\r\n			menu.spells.w:addParam("autosmallLaneclear", "Auto Shrink only in Laneclear", SCRIPT_PARAM_ONOFF, false) --DONE\r\n	\r\n	menu:addSubMenu("Laneclear Settings", "ls") --DONE\r\n		menu.ls:addParam("q", "Use Q", SCRIPT_PARAM_ONOFF, true) --DONE\r\n		menu.ls:addParam("mec", "Use MEC", SCRIPT_PARAM_ONOFF, true)\r\n		menu.ls:addParam("mecmin", "Min Minions to attempt MEC Calc", SCRIPT_PARAM_SLICE, 2, 1, 5,1)\r\n\r\n	menu:addSubMenu("Harras Settings", "hs") --DONE\r\n		menu.hs:addParam("q", "Use Q", SCRIPT_PARAM_ONOFF, true) --DONE\r\n		menu.hs:addParam("mec", "Use MEC", SCRIPT_PARAM_ONOFF, true)\r\n\r\n	menu:addSubMenu("Combo Mode", "c") --DONE\r\n		menu.c:addParam("q", "Use Q", SCRIPT_PARAM_ONOFF, true) --DONE\r\n		menu.c:addParam("mec", "Use MEC", SCRIPT_PARAM_ONOFF, true)\r\n	\r\n	menu:addSubMenu("Keys", "keys") --DONE\r\n		menu.keys:addParam("EKey", "Cast E/Q in Mouse Direction", SCRIPT_PARAM_ONKEYDOWN, false, string.byte("N")) --DONE\r\n		menu.keys:addParam("info", "Your Harras/Combo/Laneclear Keys are connected to your OrbWalker", SCRIPT_PARAM_INFO, "")\r\n\r\n	menu:addSubMenu("Drawings", "draw") --DONE\r\n		menu.draw:addParam("missles", "Draw Missile HitBox", SCRIPT_PARAM_ONOFF, true) --DONE\r\n		menu.draw:addParam("passive", "Draw Passive Circle", SCRIPT_PARAM_ONOFF, true) --DONE\r\n		menu.draw:addParam("qaoe", "Draw Q AOE", SCRIPT_PARAM_ONOFF, false) --DONE\r\n		menu.draw:addParam("inf", "  => Will drastically lower FPS", SCRIPT_PARAM_INFO, "")\r\n		menu.draw:addParam("marker", "Mark Target in Grass if hit by Passive", SCRIPT_PARAM_ONOFF, true) --DONE\r\n		menu.draw:addParam("res", "Circle Resolution", SCRIPT_PARAM_SLICE, 6, 4, 60, 0)\r\n\r\n	--End Champ Specific\r\n	\r\n	menu:addParam("autoupdate","Autoupdate", SCRIPT_PARAM_ONOFF, true) --DONE\r\n	menu:addParam("version", "Version: ", SCRIPT_PARAM_INFO, script_version) --DONE\r\nend\r\n\r\n--Some nice var\'s\r\nlocal LoadedWalker\r\nlocal lastq = 0\r\n\r\nlocal function GetQPredictionTable(target)\r\n	local AurelionSolQ = {range = 650, speed = 600, delay = 0.25, radius = 0}\r\n	if not target or lastq == 0 then return AurelionSolQ end\r\n	AurelionSolQ.radius = 130+(clock()-lastq)*50\r\n	return AurelionSolQ\r\nend\r\n\r\nlocal function setlastq(unit, spell)\r\n	if unit and unit.isMe and spell and spell.name == "AurelionSolQ" then\r\n		lastq = clock()\r\n	end\r\nend\r\n\r\nlocal function GetOrbWalker()\r\n	if _G.S1OrbLoading or _G.S1mpleOrbLoaded then LoadedWalker = "S1Orb" end\r\n	if _G.Reborn_Loaded or _G.AutoCarry then LoadedWalker = "SAC:R" end\r\n	if SAC then LoadedWalker = "SAC:P" end\r\n	if _Pewalk then LoadedWalker = "PEW" end\r\n	if _G.NebelwolfisOrbWalkerInit then LoadedWalker = "NOW" end\r\n	if not LoadedWalker then print("You need to load an OrbWalker to load this Script",4) return false end\r\n	return true\r\nend\r\n\r\nlocal function GetOrbMode()\r\n	if LoadedWalker == "S1Orb" then\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "none" then return 0 end\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "harass" then return 1 end\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "laneclear" then return 2 end\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "lasthit" then return 3 end\r\n		if _G.S1mpleOrbLoaded and _G.S1.aamode == "sbtw" then return 4 end\r\n	elseif LoadedWalker == "SAC:R" then\r\n		if not _G.AutoCarry or not _G.AutoCarry.Keys then return 0 end\r\n		if _G.AutoCarry.Keys.MixedMode then return 1 end\r\n		if _G.AutoCarry.Keys.LaneClear then return 2 end\r\n		if _G.AutoCarry.Keys.LastHit then return 3 end\r\n		if _G.AutoCarry.Keys.AutoCarry then return 4 end\r\n	elseif LoadedWalker == "SAC:P" then\r\n		if SAC:GetActiveMode() == "MixedMode" then return 1 end\r\n		if SAC:GetActiveMode() == "Laneclear" then return 2 end\r\n		if SAC:GetActiveMode() == "LastHit" then return 3 end\r\n		if SAC:GetActiveMode() == "AutoCarry" then return 4 end		\r\n	elseif LoadedWalker == "PEW" then\r\n		if not _Pewalk then return 0 end\r\n		if _Pewalk.GetActiveMode().Mixed then return 1 end\r\n		if _Pewalk.GetActiveMode().LaneClear then return 2 end\r\n		if _Pewalk.GetActiveMode().Farm then return 3 end\r\n		if _Pewalk.GetActiveMode().Carry then return 4 end\r\n	elseif LoadedWalker == "NOW" then\r\n		if not _G.NebelwolfisOrbWalkerInit then return 0 end\r\n		if _G.NebelwolfisOrbWalker.mode == "Mixed" then return 1 end\r\n		if _G.NebelwolfisOrbWalker.mode == "LaneClear" then return 2 end		\r\n		if _G.NebelwolfisOrbWalker.mode == "LastHit" then return 3 end	\r\n		if _G.NebelwolfisOrbWalker.mode == "Combo" then return 4 end\r\n	end\r\n\r\n	return 0\r\nend\r\n\r\nlocal function GetOrbTarget()\r\n	if LoadedWalker == "S1Orb" then\r\n		return (_G.S1mpleOrbLoaded and _G.S1:GetTarget() or nil)\r\n	elseif LoadedWalker == "SAC:R" and _G.AutoCarry and _G.AutoCarry.SkillsCrosshair then\r\n		return _G.AutoCarry.SkillsCrosshair.target\r\n	elseif LoadedWalker == "SAC:P" then\r\n		return SAC:GetTarget()\r\n	elseif LoadedWalker == "PEW" then\r\n		return _Pewalk.GetTarget()\r\n	elseif LoadedWalker == "NOW" then\r\n		return _G.NebelwolfisOrbWalker:GetTarget()\r\n	end\r\nend\r\n\r\nlocal function GetCTarget(range)\r\n	if not range then range = myHero.range end\r\n	local target = GetOrbTarget()\r\n	if not target or GetDistance(target) > range then\r\n		local mode = GetOrbMode()\r\n		if mode == 1 then -- Mixed Mode (Harras)\r\n			ts_instance.range = range\r\n			target = ts_instance.target\r\n			ts_instance.range = 4000\r\n			if not target then\r\n				mm_instance.range = range\r\n				target = mm_instance.objects[1]\r\n				mm_instance.range = 1500\r\n			end\r\n			if not target then\r\n				jm_instance.range = range\r\n				target = jm_instance.objects[1]\r\n				jm_instance.range = 1500\r\n			end\r\n		elseif mode == 2 then -- LaneClear\r\n			mm_instance.range = range\r\n			target = mm_instance.objects[1]\r\n			mm_instance.range = 4000\r\n			if not target then\r\n				jm_instance.range = range\r\n				target = jm_instance.objects[1]\r\n				jm_instance.range = 1500\r\n			end\r\n		elseif mode == 3 then -- LastHit\r\n			mm_instance.range = range\r\n			target = mm_instance.objects[1]\r\n			mm_instance.range = 1500		\r\n			if not target then\r\n				jm_instance.range = range\r\n				target = jm_instance.objects[1]\r\n				jm_instance.range = 1500\r\n			end\r\n		elseif mode == 4 then --SBTW\r\n			ts_instance.range = range\r\n			target = ts_instance.target\r\n			ts_instance.range = 400\r\n		end			\r\n	end\r\n	return target\r\nend\r\n\r\n--MATH\r\nlocal sqrt = math.sqrt\r\nlocal function CalcVector(source,target)\r\n	local V = Vector(source.x, source.y, source.z)\r\n	local V2 = Vector(target.x, target.y, target.z)\r\n	local vec = V-V2\r\n	local vec2 = vec:normalized()\r\n	return vec2\r\nend\r\n\r\nlocal function GetDistance(p1, p2)\r\n	if not p1 then oldprint(debug.getinfo(2)) end \r\n	p2 = p2 or player\r\n    local s = (p1.x - p2.x) ^ 2 + ((p1.z or p1.y) - (p2.z or p2.y)) ^ 2\r\n	return sqrt(s)\r\nend\r\n--END MATH\r\n\r\n--GETTER\r\nlocal qobj\r\nlocal function SearchQObj()\r\n	if qobj and qobj.valid and not qobj.dead then\r\n		return qobj\r\n	end -- Hopefully speeds up the lookup\r\n\r\n	for i=1, objManager.maxObjects do\r\n		local object = objManager:GetObject(i)\r\n		if object and object.valid and object.name and object.name == "AurelionSol_Base_Q_Mis.troy" then\r\n			qobj = object\r\n			return qobj\r\n		end\r\n	end\r\nend\r\n\r\nlocal function GetQObj()\r\n	if qobj and qobj.valid and not qobj.dead then\r\n		return qobj\r\n	end -- Hopefully speeds up the lookup\r\nend\r\n\r\nlocal missles = {}\r\nlocal function GetMissles() --I should be able to cache it\r\n	\r\n	for i=1,#missles do\r\n		local v = missles[i]\r\n		if not v or not v.valid then\r\n			missles[i] = nil\r\n		end\r\n	end\r\n	\r\n	if #missles > 3 then missles = {} end\r\n	if #missles == 3 then return missles end\r\n	\r\n	local table_iterator = #missles\r\n	for i=1, objManager.maxObjects do\r\n		local object = objManager:GetObject(i)\r\n		if object and object.name then\r\n			if object.name == "AurelionSol_Base_P_MissileSmall.troy" or  object.name == "AurelionSol_Base_P_MissileLarge.troy" or object.name == "AurelionSol_Base_P_MissileSmall_toLarge.troy" or object.name == "AurelionSol_Base_P_MissileLarge_toSmall.troy" then\r\n				table_iterator = table_iterator+1\r\n				missles[table_iterator] = object\r\n			end\r\n		end\r\n	end\r\n	return missles\r\nend\r\n--END GETTER\r\nlocal function _CalcSpellPosForGroup(radius, range, points)\r\n    if #points == 0 then\r\n        return nil\r\n    elseif #points == 1 then\r\n        return {center = Vector(points[1]), radius = nil}\r\n    end\r\n    local mec = MEC()\r\n    local combos = {}\r\n    for j = #points, 2, -1 do\r\n        local spellPos\r\n        combos[j] = {}\r\n        _CalcCombos(j, points, combos[j])\r\n        for _, v in ipairs(combos[j]) do\r\n            mec:SetPoints(v)\r\n            local c = mec:Compute()\r\n            if c ~= nil and c.radius <= radius and c.center:dist(player) <= range and (spellPos == nil or c.radius < spellPos.radius) then\r\n                spellPos = {center = c.center, radius = c.radius}\r\n            end\r\n        end\r\n        if spellPos ~= nil then return spellPos end\r\n    end\r\nend\r\n\r\nlocal function CastQPos(mode)\r\n	local x = {}\r\n	local objs = {}\r\n	if mode == 1 then\r\n		objs = mm_instance.objects\r\n	elseif mode == 2 then\r\n		objs = GetEnemyHeroes()\r\n	end\r\n	if mode == 1 and menu.ls.mecmin < #objs then return end\r\n	\r\n	for k,v in pairs(objs) do\r\n		if v and v.valid and not v.dead and v.visible and GetDistance(v) <=780 then\r\n			x[#x+1] = v\r\n			if #x > 7 then break end\r\n		end\r\n	end\r\n	if #x > 1 then\r\n		local a = _CalcSpellPosForGroup(110,650,x)\r\n		if a ~= nil then\r\n			local center = a.center\r\n			local radius = a.radius\r\n			CastSpell(_Q, center.x, center.z)\r\n		end\r\n	elseif #x == 1 then\r\n		local pos, hc, info = FHPrediction.GetPrediction(GetQPredictionTable(), x[1])\r\n		if hc > 0 then\r\n			CastSpell(_Q, pos.x, pos.z)\r\n		end\r\n	end\r\nend\r\n\r\n-- NORMAL MODES\r\n\r\nlocal function Combo()\r\n	if menu.c.q then\r\n		if menu.c.mec then\r\n			CastQPos(2)\r\n		else\r\n			local target = GetCTarget(780) --Outer limit + Radius\r\n			if target and target.visible and not target.dead and target.bTargetable and target.type == myHero.type then\r\n				local pos, hc, info = FHPrediction.GetPrediction(GetQPredictionTable(), target)\r\n				if hc > 0 then\r\n					CastSpell(_Q, pos.x, pos.z)\r\n				end\r\n			end\r\n		end\r\n	end\r\nend\r\n\r\nlocal function Harras()\r\n	if menu.hs.q then\r\n		if menu.hs.mec then\r\n			CastQPos(2)\r\n		else\r\n			local target = GetCTarget(780) --Outer limit + Radius\r\n			if target and target.visible and not target.dead and target.bTargetable then\r\n				local pos, hc, info = FHPrediction.GetPrediction(GetQPredictionTable(), target)\r\n				if hc > 0 then\r\n					CastSpell(_Q, pos.x, pos.z)\r\n				end\r\n			end\r\n		end\r\n	end\r\nend\r\n\r\nlocal function Laneclear()\r\n	if menu.ls.q then\r\n		if menu.ls.mec then\r\n			CastQPos(1)\r\n		else\r\n			local target = GetCTarget(780) --Outer limit + Radius\r\n			if target and target.visible and not target.dead and target.bTargetable and target.type ~= myHero.type then\r\n				local pos, hc, info = FHPrediction.GetPrediction(GetQPredictionTable(), target)\r\n				if hc > 0 then\r\n					CastSpell(_Q, pos.x, pos.z)\r\n				end\r\n			end\r\n		end\r\n	end\r\nend\r\n\r\nlocal function Modes()\r\n	local mode = GetOrbMode()\r\n	if mode == 4 then\r\n		Combo()\r\n	elseif mode == 1 then\r\n		Harras()\r\n	elseif mode == 2 then\r\n		Laneclear()\r\n	end\r\nend\r\n\r\n--END NORMAL MODES\r\n\r\n--AUTO EXPLODE Q\r\nlocal function autoExplodeQ()\r\n	if not menu.spells.q.autoExplode then return end\r\n	local q_obj = GetQObj()\r\n	if(q_obj)then\r\n		local size = 130+(clock()-lastq)*50\r\n		local inrange = 0\r\n		\r\n		for i=1, #enemy_heroes do\r\n			local v = enemy_heroes[i]\r\n			if(v and v.valid and not v.dead and v.bTargetable and GetDistance(q_obj,v) < size) then\r\n				inrange = inrange+1\r\n			end\r\n		end\r\n		if inrange >= menu.spells.q.minautoExplode then\r\n			CastSpell(_Q)\r\n		end\r\n	end\r\nend\r\n--END AUTO EXPLODE Q\r\n\r\n--AUTO SCALE PASSIVE\r\nlocal function autoscalePassive()\r\n	if not myHero:CanUseSpell(_W) == 0 or not menu.spells.w.autoscale or #enemy_heroes == 0 then return end\r\n	local missles = GetMissles()\r\n	if not missles or not #missles or #missles == 0 or not missles[#missles] or not myHero then return end\r\n	local missle_dst = GetDistance(missles[#missles])\r\n	local ininner = 0\r\n	local inouter = 0\r\n	\r\n	local lowlife_obj = nil\r\n	local lowlife_isinner = false\r\n\r\n	for i=1, #enemy_heroes do\r\n		local v = enemy_heroes[i]\r\n		if v and v.visible and not v.dead and v.bTargetable then\r\n			local dst = GetDistance(v)\r\n			if dst < 690 then --Is in outer\r\n				if dst < 350 and dst > 310 then --In inner\r\n					if not lowlife_obj or v.health < lowlife_obj.health then\r\n						lowlife_obj = v\r\n						lowlife_isinner = true\r\n					end\r\n					ininner = ininner + 1\r\n				elseif dst > 490 then --In outer\r\n					inouter = inouter + 1\r\n					if not lowlife_obj or v.health < lowlife_obj.health then\r\n						if not lowlife_obj or v.health < lowlife_obj.health then\r\n							lowlife_obj = v\r\n							lowlife_isinner = false\r\n						end\r\n					end\r\n				end\r\n			end\r\n		end\r\n	end\r\n\r\n	if ininner + inouter > 0 then\r\n		if menu.spells.w.ts == 1 then\r\n			if ininner > inouter then\r\n				if missle_dst > 400 then\r\n					CastSpell(_W)\r\n				end\r\n			else\r\n				if missle_dst < 400 then\r\n					CastSpell(_W)\r\n				end\r\n			end\r\n		else\r\n			if lowlife_isinner and missle_dst > 400 then\r\n				CastSpell(_W)\r\n			elseif not lowlife_isinner and missle_dst < 400 then\r\n				CastSpell(_W)\r\n			end\r\n		end		\r\n	end\r\nend\r\n--END AUTO SCALE PASSIVE\r\n\r\nfunction GetEnemyHeroesInRange(range)\r\n	local ret = {}\r\n	for k,v in pairs(GetEnemyHeroes()) do\r\n		if v and GetDistance(v) then\r\n			ret[#ret+1] = v\r\n		end\r\n	end\r\n	return ret\r\nend\r\n\r\n--AUTO SHRINK PASSIVE\r\nlocal function autoshrinkpassive()\r\n	local missles = GetMissles()\r\n	if not missles or not #missles or #missles == 0 or not missles[#missles] or not myHero then return end\r\n	local missle_dst = GetDistance(missles[#missles])\r\n	if missle_dst < 400 or missle_dst > 1000 then return end\r\n	\r\n	\r\n	if menu.spells.w.autosmallon and myHero:CanUseSpell(_W) == 0 and #GetEnemyHeroesInRange(690) == 0 then\r\n		if ((menu.spells.w.autosmallLaneclear and GetOrbMode() == 2) or not menu.spells.w.autosmallLaneclear) then\r\n			CastSpell(_W)\r\n		end\r\n	end\r\nend\r\n--END AUTO SHRINK PASSIVE\r\n\r\n--AUTO Q ON E\r\nlocal function autoQonE(unit, spell)\r\n	if unit and spell and spell.name and unit.isMe and spell.name == "AurelionSolE" and menu.spells.q.autoqone and myHero:CanUseSpell(_Q) == 0 then\r\n		local bvec = CalcVector(spell.startPos, spell.endPos)*-500\r\n		CastSpell(_Q, myHero.x+bvec.x, myHero.y+bvec.y, myHero.z+bvec.z)\r\n	end\r\nend\r\n--END AUTO Q ON E\r\n\r\n--AUTO Q/E COMBO\r\nlocal function autoQE()\r\n	if menu.keys.EKey and myHero:CanUseSpell(_E) == 0 then\r\n		local bvec = CalcVector(myHero, mousePos)*-(2000+myHero:GetSpellData(_E).level*1000)\r\n		CastSpell(_E, myHero.x+bvec.x,myHero.y+bvec.y,myHero.z+bvec.z)\r\n		if not menu.spells.q.autoqone and myHero:CanUseSpell(_Q) == 0 then\r\n			CastSpell(_Q, myHero.x+bvec.x,myHero.y+bvec.y,myHero.z+bvec.z)\r\n		end\r\n	end\r\nend\r\n--END AUTO Q/E COMBO\r\n\r\n--CREATE OBJ CALLBACKS\r\nlocal passive_hits = {}\r\nlocal IsGrass = IsGrass\r\nlocal function detectpassivehits(obj)\r\n	if menu.draw.marker and obj and obj.name and (obj.name == "AurelionSol_Base_P_Audio_StarsIn_HitLarge.troy" or obj.name == "AurelionSol_Base_P_Audio_StarsIn_HitSmall.troy" or obj.name == "AurelionSol_Base_P_Audio_StarsOut_HitSmall.troy" or obj.name == "AurelionSol_Base_P_Audio_StarsIn_HitSmall.troy") and IsGrass(obj.pos) then\r\n		local o = obj.pos\r\n		passive_hits[#passive_hits+1] = {pos = o, t = clock()}\r\n	end\r\nend\r\n--END CREATE OBJ CALLBACKS\r\n\r\n--DRAWS\r\nlocal function drawMissleHitBox()\r\n	if not menu.draw.missles then return end\r\n	local missles = GetMissles()\r\n	for i = 1, #missles do\r\n		local v = missles[i]\r\n		if v and v.name ~= "AurelionSol_Base_P_MissileLarge.troy" then\r\n				DrawCircle3D(v.x,v.y,v.z,50,1,ARGB(255,0,0,0),menu.draw.res)\r\n		elseif v then\r\n			DrawCircle3D(v.x,v.y,v.z,100,1,ARGB(255,0,0,0),menu.draw.res)\r\n		end\r\n	end\r\nend\r\n\r\nlocal function drawPassiveCircle()\r\n	if not menu.draw.passive then return end\r\n	local missles = GetMissles()\r\n	if missles and missles[#missles] and myHero then\r\n		DrawCircle3D(myHero.x, myHero.y, myHero.z, GetDistance(missles[#missles]), 2, ARGB(255,255,0,0), menu.draw.res)\r\n	end\r\nend\r\n\r\nlocal function drawQAoe()\r\n	if not menu.draw.qaoe then return end\r\n	local q_obj = GetQObj()\r\n	if q_obj then\r\n		DrawCircle3D(q_obj.x,q_obj.y,q_obj.z,130+(clock()-lastq)*50, 1, ARGB(255,255,0,255),menu.draw.res)\r\n	end\r\nend\r\n\r\nlocal function drawFOWHits()\r\n	if not menu.draw.marker then return end\r\n	for i = 1, #passive_hits do\r\n		local v = passive_hits[i]\r\n		if v and v.pos and v.t and v.t + 20 > clock() then\r\n			if(IsGrass(v.pos)) then\r\n				DrawCircle3D(v.pos.x,v.pos.y,v.pos.z, 150, 4, ARGB(255,255,0,200),menu.draw.res)\r\n			end\r\n		else\r\n			passive_hits[i] = nil\r\n		end\r\n	end\r\nend\r\n\r\nlocal function drawDebugStuff()\r\n	if min_log_level > 1 then return end\r\n	DrawTextA(#GetMissles())\r\n	\r\nend\r\n--END DRAWS\r\n\r\nAddLoadCallback(function()\r\n	if not GetOrbWalker() then return end\r\n	Menu()\r\n	Update()\r\nend)\r\n\r\nAddDrawCallback(function()\r\n	if not LoadedWalker then return end\r\n	drawMissleHitBox()\r\n	drawPassiveCircle()\r\n	drawQAoe()\r\n	drawFOWHits()\r\n\r\n	drawDebugStuff()\r\n\r\nend)\r\n\r\nAddTickCallback(function()\r\n	if not LoadedWalker then return end\r\n\r\n\r\n	Modes()\r\n\r\n	SearchQObj()\r\n\r\n	autoExplodeQ()\r\n\r\n	autoscalePassive()\r\n	\r\n	autoQE()\r\n\r\n	autoshrinkpassive()\r\n\r\n	jm_instance:update()\r\n\r\n	mm_instance:update()\r\n\r\n	ts_instance:update()\r\n\r\nend)\r\n\r\nAddProcessSpellCallback(function(unit, spell)\r\n	if not LoadedWalker then return end\r\n	autoQonE(unit, spell)\r\n	setlastq(unit,spell)\r\nend)\r\n\r\nAddCreateObjCallback(function(object)\r\n	if not LoadedWalker then return end\r\n	detectpassivehits(object)\r\nend)');
INSERT INTO `RandomBundle_Versions` (`ID`, `Name`, `Version`, `File`) VALUES
(9, 'Corki', 0.3, 'LoadEncryptedScript("")');
